2555131	Christian	Westerman	6	75	298	11.875	Westerman was a top national recruit who attended Auburn for his first two years, losing most of his redshirt freshman season due to injury before deciding to return to his home state of Arizona to finish his career. He excelled last fall in his first season as a starter for the Sun Devils, earning honorable mention All-Pac-12 notice for his stout play and mobility at left guard. Westerman's play his senior campaign did not disappoint, as his attitude, stoutness, mobility, and solid technique made him a second-team all-conference performer.	Outstanding athleticism and movement skills. Is quick off the snap and able to beat defenders to the spot. Can get to difficult cross­-face blocks using timing, technique and footwork. At his best when on the move. When pulling or climbing to second level, has a terrific connect rate against moving targets in space. True technician. Plays with desired balance and base and his feet rarely stop chopping and working after contact. Approaches target with bend and rolls hips up under him after contact. Has massive bear paws for hands and is a weight ­room freak daddy. Has hand placement and upper body strength to lockout pass rushers if he gets extension first. Father was a three-year starter at guard for Arizona State. Should test off the charts at the combine.	While he moves stacks of weights with ease, his play strength doesn't always match that when matched up against interior power players. Short yardage push will not be an NFL strength. May need more mass on his frame to handle NFL defensive tackles. When asked to base block, becomes more of a stalemate blocker than block­-winner. Could use a more authoritative punch in pass protection. I question whether he can effectively re­direct interior pass rushers once they get into the edge on him.	Alex Mack	Quick-­twitch, athletic guard who comes from a football family and has been working on his strength and athleticism from a young age. Offensive line coaches will appreciate Westerman's technical savvy and zone scheme teams will covet his fluidity and blocking ability on the move. A move to center is not out of the question thanks to his body type and quickness and his draft stock may be helped by a potential ability to offer roster depth at several offensive line positions.	\N	45	5.75	christian-westerman	\N
2555132	Cody	Whitehair	6	76	301	10.125	As the Wildcats' strongest and most athletic lineman, Whitehair (6-4, 309) has been moved from right tackle to left guard, back to right tackle, and finally to left tackle for his last two seasons. His play on the blind side earned him first-team All-Big 12 honors in 2015 (following two second-team nods and an honorable mention as a freshman), as he not only possesses the footwork to hold off edge rushers but understands the angles needed to free space for running backs. His versatility and technique make him among the top linemen in the draft class.	Four-­year starter voted team captain in 2015. Tireless worker bee in the weight room and in practices who brings a high degree of dependability and consistency to the table. Team­-oriented. Played exceptionally well while out of position at left tackle for Kansas State. Atypical body composure and control. Is almost always in complete control of his body thanks to outstanding core strength and balance. Extremely efficient with his movements after the snap. Has played both guard and both tackle spots and has roster value at all five positions. Mirrors with a wide, stout base and has great feel for keeping defender squared up throughout the rep. Confident, composed and competitive. Smooth and athletic when asked to pull and has radar to find target and strike accurate blow. Makes up for shorter arms with massive hands that function as vise grips. Consistent with hand placement and extremely sticky blocker. Combines hand strength and balance to snatch and control a defender until the whistle blows. Can sink hips at contact and should be able to stalemate bigger players across from him. Exceptional body control and core strength allows him to successfully redirect defenders who get to his edge.	Arm length is below average for interior lineman. Allows longer defenders into his framework a little too often. Needs to play with slightly faster hands inside and improve the timing of his punch. May not be able to carry much more mass on his frame. Has core power but lack of length and overall girth could lead to him allowing some pocket push against bull rushers. Played from two-­point stance as tackle in college and needs to prove he can fire out of three-­point stance and generate push at the point of attack in the running game. May need additional work and reps to get timing and angles right from the guard spot. Will get caught lunging at times when playing in space.	Zack Martin	With his combination of functional strength and body control, Whitehair might be one of the safest offensive linemen in the entire draft. He will almost assuredly be bumped inside to guard, but could be considered at center as well. He has the confidence and talent to start right away and his run blocking should improve as he gets more comfortable firing out from a three-­point stance. Whitehair has the ability to be a very good starter with a ceiling that could reach the all-pro level.	\N	14	6.42999999999999972	cody-whitehair	\N
2555133	Connor	McGovern	6	76	306	10.375	One of the strongest players in college football, McGovern has broken weight room records at Mizzou (like a 690-pound squat) and actually tore his pectoral muscle trying to bench 515 pounds. The Gatorade High School Player of the Year in North Dakota in 2010, McGovern's not just all muscle. He's started for three years at right guard, right tackle, and then left tackle as a senior. Though McGovern was solid for the Tigers at tackle, scouts consider him a better interior prospect due to that strength and his underrated movement skills. He hopes to move up boards throughout the process, just like his teammate, Mitch Morse, who was picked in the mid-second round by Kansas City in the 2015 draft.	Has broad waist and possesses outstanding strength. Broke school record with six squats of 690 pounds and partially tore his pectoral muscle during one off-­season attempting to bench press 515 pounds (did not miss any games). Takes good angles up to second level on zone plays targeting the outside shoulder of the linebacker. Solid short area foot quickness and adequate athleticism. Able to make quick step inside to catch stunts and inside pass rush moves. Smooth, well-­balanced pass sets out to defensive ends. Plays with ready hands. Has potential to land heavy punch in pass protection. When he gets on top of edge rushers, understands how to crowd them and take away their options. Mindful of twists and stunts and sees "games" early.	Still a little raw in his pass sets. Relies on opening gate and chasing edge rusher up the field rather than trusting footwork. Gets a little loose with his feet on high side of the arc and might open up inside counter moves to the quarterback (as a tackle). Has shorter arms than teams desire from tackles. Will get too cute with his hands at times rather than landing a big punch and snatching his target. Top heavy, barrel-chested build. Needs to play with better bend and wider base in space. Gets caught on skates and unable to change directions quickly when forced to adjust to moving targets on second level. As a guard, must be careful not to over-commit to first block T/E twists.	Zane Beadles	Three-year starter who has played guard and both tackle spots. While he has the power and frame of a guard, there are some teams who may give him a shot at right tackle first. McGovern still has some work to do in pass protection, but shows potential to be a starter in the league. He is an ascending prospect whose stock should rise thanks to his power and multi-­position diversity.	"He has some holes in his game right now, but I think they are all correctable. I'm looking at him as a tackle because I would like to use his power and athleticism to help spring our running game outside. I love that he's played on a line with (Mitch) Morse and (Evan) Boehm. Those are two great leaders." -- Southwest area scout	15	5.37000000000000011	connor-mcgovern	\N
2555134	Dominick	Jackson	6	77	313	9.75	Jackson was one of the top junior college players in the country at the College of San Mateo in 2013, dominating his competition at the guard position on an every-play basis. Although he played as a reserve in first year with Alabama, he made the field as a blocking back in goal-line situations because of his athleticism and willingness to take on defenders in the hole. Jackson's run blocking as the Tide?s starting right tackle in 2015 lived up to the hype, and he was solid enough in pass protection as well to be named second-team All-SEC. Jackson's versatility will be valued by NFL scouts.	Has the bubble and lower leg thickness teams look for from guards. Showed improvement throughout the season. Good natural strength. Plays with desired pad level out of snap. Rarely gets pushed around by pure power. Has natural anchor to absorb a blow from downhill linebacker and maintain contact balance. Has power in trunk to build a wall when he gets his man sealed off in run game. Excels in short pull game, stalking and leveraging his second level targets. As base blocker, keeps hands inside framework of defender and looks to latch on. Shows some ability to redirect and recover rather than taking a loss when losing early in run rep. Adequate initial quickness with understanding of angles. Patient combination blocker when needed. Plays with a sturdy base and better body control than expected. Keeps head up and out of his pass sets and has the anchor and arm extension to hold up to bull rushers from guard position. Shows room for continued improvement.	At times, more of a positional blocker than drive blocker. Allows base to narrow as drive blocker. Doesn't always play to his power potential. Too content to engage and push rather than impose his will on opponent with booming impact at point of attack. As run blocker, hands can fly open a little on second level blocks. Has some hip tightness that limits his athleticism. If he's not tight with footwork and angles, he can?t win. Needs to engage with more aggression on second level. Will allow linebackers to escape his clutches. Doesn't have the feet necessary to be an NFL tackle in pass protection. Average change of direction against pass rush. Scouts question his ability to process quickly against blitzes and twists if he moves to guard. Can be lethargic with initial punch opening door for crafty pass rushers. Short arms for the position. Needs to use faster, jabbing punch. Not athletic enough to recover as pass blocker when beaten.	John Jerry	Scouts are picking holes in his game, but the tape shows a player who consistently performed his job and who improved throughout his first season as a starter. Jackson lacks the athleticism and length to play tackle and will likely have to bump down inside, but with his thick trunk, core strength and body control, Jackson should be able to come in as a backup and may be an eventual starter in the league.	\N	88	5.29999999999999982	dominick-jackson	\N
2555139	Landon	Turner	6	76	330	10.375	An absolute road grader, Turner has turned the heads of NFL general managers with his ability to move the line of scrimmage. The three-plus year starter at right guard followed up a third-team All-ACC junior campaign with an first-team Associated Press All-American and first-team all-conference senior year. The nephew of former NFL fullback Jim Braxton plays with the same tough mindset as his uncle.	Thickly built with a bulldozer for a lower body. Grown man strength with jolting power in his hands. Blows the doors off of defensive tackles that don't have meat on their bones and power to match up. Explodes with full force into his target, bench presses his victim and runs feet after contact to finish the job. Seals down blocks and can redirect gap shooters as long as he gets his hands on them. Not overly flexible, but has enough bend at the point of attack for small space, phone booth ball. Pass sets with good arm extension and adequate posture to give him his best shot at changing direction when needed. Ability to mirror shows promise for a man his size. Plays with aggression and looks to impose his will. Pass protection and overall play showed noticeable improvement from where he was in 2014.	Smashes opposition with pure power but doesn't have the bend to snap hips into blocks and secure them longer. Needs to improve his sloppy hand placement. Labors with lateral movement. Straight-legged mover in space and will be very hit or miss when asked to pull and hit targets while on the move. Predictable change of direction concerns. Sees when power step against inside move is needed, but feet don?t always cooperate. Needs combo blocks to be right in front of him or he tends to whiff on second level. Marginal reactive athleticism limits sustained blocks against active, eager defenders. Could struggle quite a bit in pass protection against speedy, sub ­package pass rushers inside.	A.J. Cann	Landon Turner is a very easy evaluation in my estimation because his strengths and weaknesses are so obvious. Turner is a road grader deluxe whose size and power will have teams who covet those traits licking their chops. However, he?s no dancing bear and they will have to be OK with his potential concerns against quickness in pass protection.	\N	7	5.65000000000000036	landon-turner	\N
2555135	Donavon	Clark	6	76	315	\N	The Spartans had one of the best offensive lines in the country in 2015, when healthy. And when injuries took out someone up front, Clark used his toughness, stout build and length to change positions. Spartan coaches plugged him in at left tackle for four games in 2013, split his time between right tackle (five games) and right guard (eight) during his junior year, and he switched back and forth between those last two positions often during his senior year. The 2015 third-team All-Big Ten coaches' pick is best inside at the next level, and he has the attributes to provide reliable backup services, if not start.	Decent quickness laterally when asked to pull and trap. Has quick second step off the snap and into his target. Showed versatility in college. Primarily started at right guard, but also had nine starts at right tackle and six starts at left tackle. Wide­ body with power to push if his contact point is good. Praised for leadership qualities. Good football IQ. Was shifted from position to position in-­game and was able to handle responsibilities. Recognizes twist looks.	High cut with issues changing direction. Plays in both running game and passing game with a base that is entirely too narrow causing him to lose balance. Leans into second level blocks with head and shoulders out over his feet. Unable to sustain blocks for very long and struggles to consistently secure blocks when asked to move. Hand placement can turn into hug placement.	\N	Wide-­bodied guard prospect who has been able to handle his business at tackle when called on, but who lacks the athleticism to play outside in the pros. Clark?s inability to sustain blocks and make the most of his power stems, in part, from a very narrow play base and that could be challenging to correct. His intelligence and toughness give him a shot at making a roster.	\N	34	4.82000000000000028	donavon-clark	\N
2555136	Joe	Dahl	6	76	304	9.125	After spending one year at the University of Montana and another sitting out as a transfer student, Dahl stepped into the starting lineup for the Cougars and hasn't left. He was the team?s left guard for the 2013 regular season before moving out to left tackle for the bowl game ?- his home for the past two seasons. It?s no surprise head coach/offensive mad genius Mike Leach can pass 50 times a game with minimal pressure given Dahl's ability to lock down the quarterback?s blind side with good lateral movement and a solid anchor. Despite earning first-team All-Pac-12 and USA Today second-team All-American accolades at left tackle in 2015, NFL scouts will want Dahl moved inside at the next level due to his average size and length. Either way, he?ll be a worthy pick as a potential starter.	Has started at guard and tackle and could be considered emergency tackle in a pinch. Decent flexibility in his lower half. Uses wide base as run blocker. Despite playing in pass-happy offense, shows ability to fire out with pop into defender and get some initial push as drive blocker. Good grip to maintain his initial block. Has hand quickness to move inside. Does a nice job of shifting weight to challenge inside moves. Coaches rave about his work habits and ability to retain information. Added weight and then muscle to his frame over last two years. Works his tail off to recover when beaten in pass protection. Constantly looking for work and will cave in pass rusher engaged with his teammate.	Feet are a little bit heavy and he can be a little plodding when asked to block in space. Doesn't possess second level quickness to consistently get to cut­off blocks. Sluggish change of direction may turn his near misses into sacks and tackles for losses against NFL athletes. Arm length is below average so he will need more core strength to drop anchor and take a stand. Uses crab-­hand punch with hands outside the frame allowing forward leaning bull rushers to push the pocket. As game progresses, shows some waist-­bending tendencies.	T.J. Lang	Average athlete, but a good football player. Dahl fights through his limitations using determination and toughness. He will have to make a move inside and needs to continue to hit the training table and weight room to add even more mass to his frame. Dahl has potential as a drive blocking guard but needs to play with better hand placement to maximize results. Dahl projects as an eventual starting guard.	"Stud! Really tough. Played through injuries which put some shaky tape out there but if you watch him when he's healthy there ain't no doubt what he's going to do in the pros." -- Pac-12 scout	54	5.40000000000000036	joe-dahl	\N
2555137	Jordan	Walsh	6	74	292	\N	It?s no wonder that the Hawkeyes had success on offense in 2015 with guys like Walsh up front. The three-year starter at right guard stands up his man in pass protection and anchors despite a slightish frame. He impressed league coaches enough, using his agility and explosion, to be voted first-team All-Conference this fall. Expect NFL offensive line coaches to be similarly captivated with his skill set.	Plays with good foot quickness and works his combination blocks with excellent timing and teamwork. Technique in pass protection showed great improvement from 2014 to 2015. Consistent hand placement is big for him. Mirrors well with ability shuffle and changes directions with ease. Hands always at the ready and uses quick­-triggered, well-­placed punch to counter his lack of size in pass protection. Comes out of snaps with flat ­back and low pads. Able to adjust his body and blocks when engaged in space. Well-coached. Can keep defenders moving on zone plays and is able to kick out and finish. His tape was very consistent throughout the season.	Play strength is average and he must add mass. Has some tenacity as a blocker, but needs technique to be on ­point to handle NFL size up front. Will need to eliminate leaning on second level blocks to improve his sustained blocking. Babies his cut blocks. Needs to get better at working through target. Unlikely to generate power or movement at point of attack as base blocker. Won?t fit in power-­based run game. Base gets a little wide in pass protection. At times, labors to pass off initial twist which puts him behind when next man comes his way over the top. Strength to secure cross-­face blocks and overall contact balance in question. Anchor is average against bull rushers.	John Urschel	Combine with center and teammate Austin Blythe to become an extremely consistent tandem that helped to spring the running game this season. Walsh plays with good hand usage and his play strength isn't bad for his size, but unless he's hiding weight somewhere, a move to center might be in his future.	\N	32	5	jordan-walsh	\N
2555138	Joshua	Garnett	6	76	312	10.125	Garnett, the son of an NFL nose tackle (Scott Garnett), played in the shadow of other NFL-ready Stanford linemen like 2015 first-round pick Andrus Peat before his senior year. He emerged from that shadow this fall, however, winning numerous All-American honors and the Outland Trophy as the nation?s top interior lineman. His combination of size (6-5, 325) and movement dropped jaws around college football -- especially when he takes an occasional turn as an H-back. Add intelligence and a nasty streak, and Garnett?s got everything an offensive line coach would want to be part of his group.	Powerful frame with dense, muscular lower body. Very powerful at point of attack -- especially as base blocker. Held his own in the power department against UCLA?s Kenny Clark. If he gets downhill momentum on defender, it?s lights out. Able to strike and center his blocks between his shoulders. Team captain. Very good hand placement, upper body strength and hip torque to steer and turn opponent on hook blocks. Generates good power from legs and hips. Block winner in tight space near goal line. Takes good angles to second level block to make up for his lack of athleticism. Hard to beat him early in the rep on run plays. Can bury gap shooters with cave­-in blocks. Comes out of stance with good bend, pad level explosion into target. Has power and hand strength to snap off twisters and receive incoming defender. Well schooled with good hand work.	Despite being asked to pull and get cut-­off blocks at Stanford, he has some athletic limitations that could be magnified in pros. Slow to get out in front on long pulls. Gets a little lazy with his feet and tries to outmuscle opponents rather than combining strength with proper footwork. Falls in love with mashing opponents within the early stages of a rep and forgets to bring his feet under him to secure the block causing him to fall off at times. Head­-ducking pass protector who misses twists at times because he sees them too late. Opens himself up to problems against crafty defensive tackles by leaning too much in protection. More of a hug and contain approach against rushers rather than inside punch.	Gabe Jackson	Thick, powerful guard who can gain an early advantage in the rep and finish with authority. Garnett looks to establish a new line of scrimmage on every running play and is a great fit for a team looking to impose their will between the tackles. While he?s a plus run blocker, his pass protection issues should not be taken lightly and will have to be vetted with offensive line coaches to make sure they are correctable issues. Garnett should be an early round pick who can come in and start right away.	"He's a physical dude but needs to clean up his body some. The team nutritionist will be important for him. Love the power, but a little worried that he can?t unlock his hips." ­ -- NFC Pac-12 scout	51	5.88999999999999968	joshua-garnett	\N
2555140	Lene	Maiava	6	76	301	\N	In his first year as a full-time starter, Maiava (my-AH-vah) earned enough love from scouts to earn postseason all-star game invitations. The Wildcats' senior right tackle started all 13 games for the squad in the fall, after coming in a "super sub" in his sophomore and junior years. Maiava stepped in for seven starts at either guard spot as well as one as right tackle in 2013 and 2014. The Samoan didn't know any English when he arrived in the United State for the 2011 Polynesian All-American Bowl, and also went through adversity during his redshirt freshman season when he suffered a season-ending torn ACL.	Has ability to generate push as a drive blocker. Accelerates into his block and churns his feet to widen rushing lanes when down blocking. Possesses adequate power to play inside. Decent lateral agility and quickness and is an effective cut blocker. Uses fluid, jabbing punch and works to re­set hands when they are out of position. Improved pass protection technique as season progressed. Will lean at times, but isn?t a head ducker. Athletic enough to pull and get out in front. Has experience at both guard spots and right tackle.	Has long torso and short legs. Tight hips cause issues gaining necessary ground with kick­slide in pass pro making life as an NFL tackle challenging. When he senses his edge is threatened by speed, he?ll lean and lunge. Has issues over­setting and opening a lane to his quarterback. Lacks recovery skills. Once beaten around the corner, it?s over. Struggles maintaining proper weight distribution causing him to play on skates when in space. Marginal instincts. Slow to adjust his plans as run blocker and can be fooled by blitz looks.	\N	Pass protection from 2015 was problematic at right tackle, but his guard tape from 2014 was more promising and showed a better fit for his strengths. Maiava?s issue with balance and body control could make him an inconsistent blocker in both the run and pass, but he will step up and whip his man from time to time. There is enough to like that gives him a shot at making a run in camp and potentially finding a practice squad.	\N	46	5.07000000000000028	lene-maiava	\N
2555141	Marquis	Lucas	6	75	319	\N	Lucas' life came more into focus when he became a father early last year, as he knew that he could help provide for his family with hard work in the classroom and on the football field. And with leaders on the offensive line Mark Glowinski and Quinton Spain leaving school, Lucas got his opportunity to step into a leadership role. Not that he hadn't contributed in previous years; Lucas was a reserve in his redshirt freshman season, started four games at guard in 2013, and then started all 13 games at right tackle as a junior. He made the move to the left side for the Mountaineers this fall, and he grabbed the attention of NFL scouts in the process.	Might offer roster flexibility as a reserve guard or tackle. Has serviceable foot quickness in his pass sets and climbing to the second level. Understands hand placement and will work to re­establish his hands inside when beaten to the punch by defender. Strong hands to grasp and ride it out. Shows patience and timing when shooting his hands in pass pro. Uses proper angles and footwork when bouncing to second block of a combo. Not a great athlete but good enough to be considered by teams. Plays with composure and doesn?t show much panic no matter who he is facing.	Flexibility is a concern as he doesn't show much hip bend causing him to play way higher than desired. Not as tall as desired from the tackle position and doesn't have above average arm length to make up for it. Some scouts concerned over hand quickness if bumped inside to guard. Needs to improve pad level for more leverage at point of attack. Not much initial jolt at first contact, feet slow and base tends to narrow robbing him of build up power. Cross­-face blocks could be a chore. Plays from behind when facing plus athletes.	\N	Primarily a tackle in college, some evaluators do not believe he has enough overall length to be considered as a tackle prospect, but rather a guard. Lucas does a respectable job as a college lineman, but a jump in competition at the professional level could expose some physical flaws that won't be easily correctable. Lucas could make it into an NFL camp at some point.	\N	29	4.90000000000000036	marquis-lucas	\N
2555142	Rees	Odhiambo	6	76	314	9.625	The native of Kenya has been impressive over the past three years when healthy, displaying pro-caliber footwork and a solid anchor in pass protection while earning All-Conference honors the past two years (second-team in 2014, first-team in 2015). However, Odhiambo (pronounced AH-dee-AHM-bo) has not been able to start more than nine games in any season due to injuries (he broke his ankle in this season?s ninth game). Still, whether he serves as an undersized tackle or proves strong enough to move inside (like former Boise State LT Daryn Colledge), Odhiambo has starter-quality skills.	Played tackle in college but will be considered at both tackle and guard and carries some two­-position value. Looks great on the hoof with muscle and thickness throughout his frame. Flexible hips and knees and should be able to drop his pad level as guard in the pros. Uses wide, well­-balanced base and possesses above-­average body control. Tough, technique­-driven approach. Uses feet to close distance with target rather than reaching, leaning and panicking. Able to maintain power when moving laterally. Has athleticism and body control to be effective pulling guard and zone scheme fit as right tackle or guard. Keeps eyes up and on his target at all times. Can mirror and punch with inside hands. Upper body strength and hip snap to turn opponent as base blocker. Has heavy hands and makes defenders feel it when he lands.	Suffered a broken ankle that knocked him out for the season in late October. Has had to cope with injuries during his time at Boise. Never played a full season of football. Despite his physical talent, will let blocks get away from him that appear to be secured. Can be late with his hands. Not as tall or long as NFL teams are looking for from NFL tackles. Will need to prove he can play with faster hands if he bumps inside to guard. At times lingers with his punch opening him up to issues with crafty interior defenders. Would like to se