ayed both guard spots and center, but size likely limits him to center only in the league. Teams may view him as fit for zone specific teams which could limit his draft stock. Catches pass rushers rather than punching. Will have to adjust to defensive tackles using length to disrupt his task. Tape shows potential mental mistakes in protection against blitzes.	Matt Paradis	Played with consistency throughout his stint as a four-year starter at Iowa and his 2015 tape is solid from start to finish. While his lack of physical traits could hurt where he is taken in the draft, his functional strength, technical savvy, athleticism and body control should not be ignored as he has all the makings of an eventual NFL starter.	\N	32	5.24000000000000021	austin-blythe	\N
