2555194	Cole	Toner	7	77	306	9.75	Toner had to deal with current Indianapolis Colts defender Zack Hodges during every practice as a sophomore and junior, so most opponents on the Ivy League schedule were a piece of cake in comparison. The first-team All-Ivy League pick in both 2014 and 2015 looks like an NFL prospect, and he shows the toughness and footwork to win as a run blocker and pass protector. If the 2015 Associated Press All-American continues to fill out his frame after this season and early in his NFL career, he has a chance to contribute sooner than later.	Shows willingness to give ground in order to improve his angle on cross-­face blocks in zone blocks. Decent timing with climb to second level off combo blocks. Appears to have adequate foot quickness to redirect back inside and is able to mirror rushers. Careful with his punch and won?t give away hands too early. Fires off a heavy, well-­timed punch with some heat behind it. Aggressive approach in pass pro. Looks to take it to the defensive ends rather than sitting back passively and reacting to their rush. Was invited by former NFL GM Phil Savage to play in the Reese's Senior Bowl. Has a basketball background in high school.	Despite basketball background, hip tightness is a concern. Sits up high in two-­point stance and comes out of his stance with elevated pad level. Foot quickness is very average laterally. Marginal bend and foot quickness could present a major concern when asked to cross-­face and secure blocks against NFL athletes. Shuffles wide in his pass sets and doesn?t always maintain proper weight inside opening him up to inside counters in pass rush. Opens and chases at the top of the rush rather than calmly riding rusher around the arc. Too much gallop in his pass sets and not enough quick, choppy steps. Narrow base and lack of hip flexion could indicate an issue with speed-­to­-power rushers. Play strength looks very average.	\N	Projecting Toner as an NFL prospect isn't easy. His tape at Harvard is pretty solid, but the level of competition is nowhere near what he will see as a pro and the more tape you ingest and the more you begin to project, the more his average feet, strength and hip flexion become a concern. Toner's Senior Bowl week will have everything to do with his draft projection. I see him as a right tackle only who might have to battle to earn a roster spot.	\N	231	5	cole-toner	\N
2555195	Fahn	Cooper	7	76	303	\N	Cooper fell below the radar as a high school recruit from Illinois, so he took a scholarship at Bowling Green. He started at left tackle as a redshirt freshman, but wanted to play for a major program so he transferred to the College of DuPage to catch the eyes of recruiters, rather than sitting out a year as a transfer. Ole Miss gladly welcomed him as a starter in 2014 (11 at right tackle, two at left tackle) and he continued to excel with the Rebels as a senior, starting for the suspended Laremy Tunsil the first seven games of the year before moving back to the right side.	Shows toughness in his approach and won?t back down from a physical challenge. Has the length to land an early punch on pass rushers and the big paws to snatch and ride a second level linebacker if he gets into them squarely. Good thickness in his lower half. Head coach Hugh Freeze praises him for leadership on and off the field. Started every game over his two years at Ole Miss and has played both tackle spots.	More of an "in the way" player in space than functional blocker. Base may be too wide in pass sets causing some of his balance issues. A little labored in his pass sets and possesses below average athletic traits. Sluggish in his change of direction. Weight drifts a little behind his feet allowing pass rushers to get strong initial push on him on some reps. Unable to be effective space player.	\N	Cooper is one of the tough guys up front for the Rebels, and he has good size and length for the position, but he will be limited to run blocking in tight quarters and his lack of overall athleticism and body control could make him too leaky in pass protection to ever see the field as a starter.	\N	93	5.04999999999999982	fahn-cooper	\N
2555196	Halapoulivaati	Vaitai	7	78	320	10.625	In high school, Vaitai and his two younger brothers Will and Kevin formed the left side of his team's offensive line. Not surprisingly, Haltom, Texas' running offense was quite left-handed. Halapoulivaati was the top prospect among the three due to his size. He played five games as a back-up in his first season in Fort Worth, and then earned seven starting in year two (first five at right tackle, two at left tackle). Vaitai continued to show versatility, starting at right tackle in 2014 and left tackle in 2015.In his senior year, he garnered second team All-Big 12 honors for the second-ranked scoring offense in the country (46.5 points per game).	Has played both right and left tackle spots at TCU. Shows decent lateral quickness off the snap on zone runs. Adequate athleticism in space as run blocker. Well-­schooled and shows some technical savvy. Looks to land first and with inside hand as pass protector. Keeps head up and chin tucked on most of his pass sets. Able to see twists and games up front and is rarely fooled by them.	Too stiff-­legged and upright after the snap. Can give ground to bull rushers due to high pad level. Very poor hand strength and is inconsistent with arm extension. Lacks strength in hands to latch on and control a rep and allows defenders to break away from him. Very average foot quickness for power step back to challenge inside moves. Doesn?t gain enough ground to the edge in shuffle slides and will be beaten around the corner by athletic, NFL rushers.	\N	Vaitai has been a full-time starter over the last two seasons for a successful TCU squad, but doesn?t have the plus athleticism to play left tackle or the hand strength and core power to start on the right side. Despite decent technique and football intelligence, may be too lacking in physical qualities to make the NFL leap.	\N	63	4.75999999999999979	halapoulivaati-vaitai	\N
