etic traits are a concern.	Ryan Harris	While Spriggs has been one of the hotter tackles names in some draft circles, the tape shines a bright spotlight on concerns that could derail his future success as a tackle. Spriggs has outstanding athleticism, but his play strength and overall recovery ability are major concerns for a position as important as tackle. In my estimation, a move inside to guard or even center for a zone scheme team is the best fit to accentuate Spriggs? strengths and hide some of his weaknesses.	\N	31	5.54000000000000004	jason-spriggs	\N
2555198	John	Theus	7	78	313	10.125	The five-star recruit struggled at times early in his career for the Bulldogs, though starting at right tackle as a true freshman in the SEC is quite an accomplishment. The light bulb really seemed to go on for Theus in 2014, both in pass protection and as an effective run blocker after he moved to the left side. The Bulldog finished his career by starting every game for the second straight year and being named first-team all-conference. Theus' solid technique and underrated athleticism will make him difficult for teams to ignore early in the draft.	Reliable and consistent. Full time starter for three of his four years at Georgia. Good height with arm length that meets the NFL standards. Plays with pretty good hand quickness and has a well-­timed punch with some pop behind it. Instinctive and reacts quickly to catch and smother twists. Understands importance of early hands and can handle his business when he wins early in the rep. Good balance and set­up in his pass sets. Started at both tackle spots so he may offer some swing tackle potential for NFL teams. Has enough athleticism to help spring runs to the perimeter.	Struggles against plus power and has major issues redirecting when his edge is attacked. Inconsistent sustaining run blocks and will get controlled and rag­-dolled at times if he doesn?t win early with his hands. NFL­-caliber anchor missing against true bull rush. Needs to maintain wider, balanced base when asked to drive block. When beaten inside, has a habit of going dead­-legged and leaning back inside rather than taking quick steps to close off the lane. Has plus hand­-eye coordination, but his feet don?t always seem to be synced to the same schedule. Kick slide quickness to the edge; opens up too early and gives away the edge too early.	David Quessenberry	Consistent starting tackle from the SEC who has battled against upper-­echelon college talent. While Theus has experience at both tackle spots, he may have issues in the NFL because he lacks the foot quickness of a left tackle and the power of a right tackle. He has the technique and talent to be drafted and fight for a swing tackle spot within his first two seasons, but he must add strength and mass.	"I think his skill level is just fine, but he's extremely weak with no edge strength to help widen the pocket. He's not soft, he just isn't strong. That's going to be a big problem for him." -- AFC personnel director	83	5.09999999999999964	john-theus	\N
