2555200	Kyle	Murphy	7	78	305	9.75	Murphy played like a solid right tackle prospect as a second-team All-Pac-12 pick his junior year, his first full year as a starter. In 2015, however, the brother of former Harvard and Minnesota Vikings tackle Kevin Murphy slid to left tackle and improved greatly in pass protection while maintaining his toughness in the run game. He combined with left guard Joshua Garnett as first-team All-Conference picks on the blind side of quarterback Kevin Hogan, who reaped the benefits of their play.	Has good feel for the position. Very aware in pass protection seeking out blitzes and twists and takes consistent angles up to the linebackers in the running game. Once he gets moving in space, is able to open up his hips and run with a relatively athletic gait. Plays with strong hands and good placement that can snatch and latch if he gets there first. Makes low pad level a priority in run game. Is usually low man and will use good leg drive or snap hips to secure the block. Adequate change direction in space. Patient second level blocker allowing the block to come to him. Outstanding work with teammate Joshua Garnett with combo blocks and double teams. Doesn?t lean in pass protection and can gain decent ground with his kick ­slides.	Feet are just average from a quickness standpoint. While he can be a little slow out of his stance and off to the races when moving laterally. Will get antsy pre-­snap. Tape shows him getting some headstarts that weren?t called by college officials. Troubling anchor issues as pass blocker. Will get stiff legged at impact in protection, raising pad level and losing anchor leverage. Needs to play more flat­-footed when shooting his punch. Speed to power rushers give him problems so may need to make inside hand placement a greater priority.	Ty Sambrailo	Interesting prospect full of juxtapositions. On one hand, he?s an athletic mover in space, but his foot quickness is just average. While he plays with good bend, leg drive and low pad level as a run blocker, he tends to play too tall and lose his anchor against bull­ rushers. Murphy plays with good tackle instincts and shows enough potential to become an eventual starter in the NFL if he can improve his overall strength and tighten up some of his pass protection flaws.	"I don't think you can play him for at least a year until he gets stronger. He's a good run blocker but I don't know if he's strong enough to play on the right side or quick enough to play left." -- AFC general manager	51	5.33000000000000007	kyle-murphy	\N
