erage body control. Struggled to match inside/out rush moves of LSU?s Arden Key in his bowl game. Hands can be a little frenetic and end up outside defender?s frame. Will benefit from a stronger inside hand in his punch. Needs to improve hand placement. Slightly deficient in core power. Has quick feet but average footwork, especially after contact. Posture in protection needs work. Rarely a flat­-backed, flat­-footed puncher. Leans and makes contact while on balls of his feet or with feet in transition and will give some ground. Footwork and hands not always synced. Relies too heavily on length over feet. Pad level rises at contact robbing him of optimal leverage. Not a natural bender in space and struggles to redirect his body and strike moving targets.	Bobby Massie	Clark is an ascending left tackle prospect with the elite foot quickness and length that NFL teams simply don?t pass up for very long. Clark could still use more muscle on his frame and will need to be much more consistent with his technique rather than just relying on his length if he is to reach his full potential in the pros. Left tackles with his potential in pass protection carry first round value and Clark has a Pro Bowl upside with the floor of an average NFL starter.	"He's going to end up being big time in our league. He's got elite foot quickness, he's long and he's smart. He'll keep getting better once he gets to a pro offense and away from that stuff Texas Tech does and he'll become one of the top five tackles in our league." -- NFC personnel director	21	6.04999999999999982	leraven-clark	\N
2555220	Derek	Watt	3	74	236	\N	Watt isn't an athletic freak like his older brother and 2014 NFL Defensive Player of the Year, J.J. Watt, but he'll be a tough cut from an NFL roster. While not a thumping fullback/H-back, he has the athleticism to find targets and create creases for excellent backs such as 2015 first-round pick Melvin Gordon. Watt is a solid receiver (15 catches for 139 yards this season) and can contribute on special teams as well, showing off the tackling skills he possessed as a second-team USA Today All-American high school linebacker. He played the second half of the 2014 season while recovering from a broken foot in the opener, but came back to stay healthy as a senior.	Utility man deployed all over the field. Used as lead-blocking fullback in traditional rushing attack. Blocked from "I," off­set and tight end spots. Great radar to fit up on linebackers. Plays with desired toughness and dirty work mentality for the position. Shows no hesitation into iso blocks or when asked to take on defensive linemen. Solid in pass protection. Runs a quality route and had no drops this season. Runs through first contact after the catch. Work ethic and football IQ run in the family. Can offer immediate special teams work.	Needs to add more beef to match­up with NFL size. Doesn?t have NFL­ juice as a lead blocker. Will need to improve angles and leverage as a lead blocker to offset lack of power. Half­strider who doesn?t have the acceleration or stride to create much separation out of his breaks as a pass catcher. Mostly a body catcher.	Kyle Juszczyk	Watt?s versatility will be appealing to offenses looking for hybrid types who help to disguise their offensive intentions. While he?s not a hammer­head lead blocker who can blow holes open, he can handle his blocking assignments. Watt is an effective play-­action fullback who is a jack-­of­-all­-trades player, but master of none. Watt will likely be a third day selection by a team looking for a solid move­ fullback.