d arm length teams like from outside receivers who are called on to win 50/50 throws downfield. Wasn?t physically challenged by quality press coverage very often in college.	Steve Smith	Sharp was used as a catch-­and-­run target in 2014, but this season, Utah State allowed him to take the top off of his defenses with his blazing speed. Sharp has the speed and overall ability to play outside but he could also be used in the slot by teams looking to mismatch him on slower or less physical cornerbacks. His two­-game suspension is a concern for NFL scouts and they will dig deeper into his background, but as a football player, he has the talent to become a very productive starter.	"I like him quite a bit as a player. He didn't get that two-game suspension for nothing so there is that. Hard to imagine anyone watching the tape of him not being immediately impressed. I wish he were a little bit taller but I see him as a move receiver who can switch between outside and the slot depending on the matchups from game to game." -- NFC area scout	73	5.37000000000000011	hunter-sharp	\N
