atch for additional ?RAC? yards. Willing to block, but has size and temperament to become much better at it.	Doesn?t have the cushion-­eating, vertical speed to scare cornerbacks. Cornerbacks will crowd his underneath routes from off­-man coverage. Benefitted with several easy catches in space against zone coverage. Struggled to free himself from press coverage against LSU?s Tre?Davious White and may have separation issues in pros against quick cornerbacks. Takes time to gear down into breaks once he gets speed up. Could stand to be more physical in his release against press. Had more focus drops in 2015 than over previous two seasons. Suffered season-­ending injury in November of 2014 with broken fibula and dislocated ankle.	DeAndre Hopkins	Like DeAndre Hopkins, both players should be defined by their talent, ball skills and consistency of production over pure speed numbers. Treadwell is at his best when he has a clean, two-­way go off the line of scrimmage and he could be a challenging size matchup from the slot. While Ole Miss used him underneath quite a bit, he runs quality downfield routes and has the ball skills needed to become a more vertical receiver than underneath, possession guy.	"He's going to get beat up because he's slow but I like everything else he does. You would think scouts would learn about overestimating speed and underestimating tape. He'll go in the first but not sure how high." -- AFC Southeastern scout	93	6.25	laquon-treadwell	\N
