2555232	Shaquille	Powell	2	70	205	\N	Most college football players spend the summer between their junior and senior years working in the classroom, weight room and on the practice field to prepare for their last campaign. Powell spent most of his, however, grieving for his younger brother, seven-year-old Malachi Briggs, who died after battling kidney cancer. He returned to campus before the 2015 season, and played well with a heavy heart. Powell started 11 games, running for 542 yards and three touchdowns on 125 carries while having a major role in the passing game (35-212, two TD). He had started 11 games the previous season, as well, leading the team in rushing (134-618, two TD; 18-154 receiving, one TD). He also contributed as a freshman (28-93 rush, 1-4 receiving) and sophomore (62-344 rushing, 2 TD; 8-90 receiving, one TD). Powell fumbled once in his college career, versus Virginia Tech in his freshman year.	Possesses decent initial, short­-area quickness with a jump­cut to avoid early trouble. Decisive inside runner with the vision to make quality hole choices when needed. Low center of gravity. Will run through arm tackles and is rarely knocked off balance at contact. Churns legs to maximize his runs. Competitive and tough. Doesn?t give the ball away with fumbles. Solid hands out of backfield and gets upfield after catch. Willing to step up and meet the challenge in blitz pickup.	One speed runner. Plays hard, but limited by average athleticism. Shows some hip tightness. Takes a little while to gear down on cuts and doesn?t plant and go on outside run. Will duck head into contact losing immediate vision of space ahead. Can?t get to the tough backside cut­back lanes. Athletic linebackers can close him out on runs to the perimeter. Missing desired wiggle on second level. Lacking big back size to go with his demeanor.	\N	Time­share running back in college who is long on heart and toughness, but short on explosiveness and NFL­-caliber athleticism. Powell?s college