2555233	Tra	Carson	2	71	227	9.25	Carson is a load with just enough speed to make linebackers regret leaving a gap for him to run through. The transfer from Oregon (after only one season) started just four games in 2014, but still led the team with 581 rushing yards. His Offensive MVP performance in the AutoZone Liberty Bowl (133 yards) portended his strong senior campaign which saw him cover 1,165 yards and score seven times on the ground as well as contribute regularly in the passing game (29-183, one TD).	Physical runner who looks to send messages. Uses his lead shoulder as a weapon to dole out punishment. Has a good feel for contact and will lean into tacklers allowing him to maintain balance and continue the run. His feet never stop churning. Has just enough wiggle to avoid an occasional tackler with slight hip turn. Tough in pass protection and is willing to stick his nose in and absorb a lick to keep his quarterback clean. Really good hands. Was outstanding high school basketball player. Has potential to be a third-down back in the pros. Possesses a great deal of value on special teams as a punt protector and cover man.	Despite having some explosive traits, he's limited by some hip tightness. Needs several baby­ steps to slow down and gather himself to make a sharp cut. Will show some hesitation through the hole and doesn't appear confident in his vision. Missing the desired feel for running games. Left too many yards on the field on inside zone plays because he didn't maintain a tight track. Not enough elusiveness to make NFL tacklers miss. Power approach limits his value.	Tim Hightower	Carson doesn't possess the skill level necessary to be a starter or even part of a combination of backs to lead the charge for a team, but his toughness and ability to grind it out in short yardage gives him some value. With his hands and blocking, Carson has immediate third down potential and his ability to shine on special teams only strengthens his chance to be drafted and 