r with the lower body strength to command his gap, but the instincts and timing to be productive as a tackler rather than just a space ­eater. Reed?s lack of pass rushing ability creates a potential glass­ ceiling on his draft stock; however, teams looking for a battle-­tested run ­stuffer will find an instant upgrade who should be able to come in and start immediately if needed.	\N	88	6.19000000000000039	jarran-reed	\N
