o size and scheme concerns, but his ability to rush the passer from the interior will be sought out by others who recognize his potential value.	\N	43	5.54999999999999982	sheldon-day	\N
2555242	Sheldon	Rankins	10	73	299	9.375	In the Cardinals' three-man front, Rankins presents issues for both interior and outside blockers. His only start as a sophomore was in the team's bowl game, but he came on strong as a junior in the team's first year in the ACC (13.5 tackles for loss, eight sacks, two interceptions). ACC coaches elevated him from a third-team all-conference pick to second team this year (13 tackles for loss, six sacks) as he continued to terrorize ballcarriers. Rankins' versatility as a potential starting five-technique or three-technique makes him a fit in any system.	Powerfully built lower half with very good strength. Is extremely compact, but still flexible and very athletic. Everything he does is explosive. Fires into blockers and can jolt and displace them with a combination of leverage and power. Strong base provides excellent balance to battle against double teams or down blocks. At times, will absolutely own finesse blockers. Elite foot quickness for interior defender. Will be difficult to hook or cross­face for NFL offensive linemen because of his lateral quickness. Plays with powerful, violent hands. Can play in 2­-gap or 1-­gap scheme and did just that at Louisville. Plays through the blocker reading and shedding on time to make tackles against the run. Loose, explosive hips that allow him to win edge battles and turn the corner as pass rusher and potentially excel in twist game. Highly productive pass rusher in each of the last two season. Bloodhound with great instincts to diagnose and shut­down screens.	Undersized for full-­time interior position by NFL standards. Flashes quite a bit on tape, but many of his victims lacked the strength that he?ll see from NFL guards. Despite having decent arm length, is hardly long-­levered and could struggle to turn the corner against an NFL redirect block once he gets on a guard?s edge. Average secondary rush when his initial charge is stymied. Scouts believe he could lose some quickness if he