ith long arms and outstanding athleticism that allows him to work on offensive linemen with a combination of power and quickness. Butler has a raw but diverse skillset as a pass rusher that should excite NFL evaluators who see the potential of what he can be with more coaching and experience. With his effort and defensive ball awareness, his ceiling appears to be high with a chance to become a high-­level starter for an odd or even front defense.	\N	111	6.15000000000000036	vernon-butler	\N
