ster than timed speed thanks to combination of instincts and burst to the ball. Shows plus lateral agility with ability to engage in, shed, or beat the block.	Needs to learn to harness his energy and passion to improve his body control. Will end up on the ground a little too often due to revved up motor. Average athlete with below average straight­-line speed. Plays upright. Needs more bend in his waist and knees to improve his pad level and leverage. Can improve his tackling. Will get run through at times due to leverage issues. Stiff change of direction creates arm tackling situations and missed tackles. Gets caught guessing sometimes and will vacate his run fit.	Zach Thomas	Scooby Wright probably won?t tear up the combine with eye-popping athletic numbers and his injury-plagued 2015 season put his name on the back­burner as far as draft discussions, but his instincts, production and overall competitive fire make him one of the safer second day bets in this draft. He could make a late move up the draft board for teams who value elite production.	"I hope he falls to us because I will do everything in my power to get him drafted. Make Zach Thomas your comp for him. They are the exact same guy." -- AFC East area scout	46	6.01999999999999957	scooby-wright iii	\N
