ut his height outside. Big receivers will pose a challenge on the next level. Had his two worst games of the season in SEC Championship game against Alabama and Citrus Bowl against Michigan. Willingness to throw body around in run support could cause him to break down.	Joe Haden	While scouts have voiced some concerns about Hargreaves' size and recovery speed, you won't find anyone who doesn't admire his competitiveness and consistency of production. Hargreaves has a level of suddenness and explosiveness in his movements that should always have him near the ball. With top-notch ball skills and exceptional instincts that drew praise from Alabama's Nick Saban, Hargreaves possesses the football makeup to become a Pro Bowl cornerback.	\N	82	6.70000000000000018	vernon-hargreaves	\N
2555300	Victor	Ochi	9	73	246	10.125	Ochi's a Long Island boy, growing up a stone's throw from JFK Airport in Valley Stream, and then moving on to Stony Brook University. Even though most college football fans haven't heard of the Stony Brook Seawolves, they should know Ochi's (o-chee) name. The New York all-state pick's college career began with a bang in his redshirt freshman season, starting five games, making 45 stops, 7.5 for loss, and one sack. He harassed ball carriers in the backfield even more regularly as a sophomore (nine starts, 33 tackles, 10 for loss, 5.5 sacks) before starting his collection of postseason honors in 2014 by garnering first team All-Colonial Athletic Association honors (57 tackles, 16.5 TFL, 11 sacks). Ochi's ascension continued through his senior year, as he took home CAA Do-Defensive Player of the Year honors after leading the FCS with 13 sacks in the regular season (among 16.5 total tackles for loss) on a defense led the nation in fewest yards allowed.	Plays standing up or with a hand down. Sets a nasty edge with a thunderous punch that jars lower end competition. Constricts running lanes and looks to dive down the line of scrimmage to make tackles. Active, heavy tackler. Loves the game and plays with toughness. Able to decimate FCS tackles with punch, snatch and tug move that sends them to the ground. Will run right through soft-­edge tackles on the way to hit the quarterback. Has long arms and gets adequate extension at point of attack. Holds Stony Brook records in tackles for loss and sacks.	Smaller than desired for an edge defender. One­-speed pass rusher who plays with square pads over shoulder turn and hip flip around the edge. Stiff mover in space. Ill equipped to drop in space or cover. Hand usage is somewhat basic. Pass rush lacks spontaneity and allows rep to play out rather than controlling it with counter moves. Snap anticipation and recognition of play flow needs to speed up. Level of competition was substantially below t