ointing. Produced low tackle totals and just 6.5 sacks over three years. Never forced or recovered a fumble. Ducks head into initial off snap losing track of the ball. Tightly ­wound, straight-line athlete who needs play to stay inside his optimal area of movement. Inconsistent effort after his initial pass rush move is thwarted. Needs to develop a counter rush move. Was suspended for Sugar Bowl after being arrested and charged with marijuana a possession. Scouting community has serious concerns about his personal character and work ethic.	Sharrif Floyd	Considered the top­-rated prospect in the nation when he signed with Ole Miss, the 3-­technique tackle is considered one of the key cogs in turning around the Ole Miss program. His talent and frame are worthy of an early selection, but his lack of high-­end production and character concerns could cause him to slide. With that said, he has the talent to be an impact starter in the league.	"Body beautiful and from the Shawn Oakman school of production. He's a much better talent than Oakman, but Oakman is the better kid. He will not be on our board as a first-round option. If he slides, we'll see." -- NFC executive	93	6.32000000000000028	robert-nkemdiche	\N
