erring to wait on plays rather than racing downhill to own them. Not strong enough at point of attack to maintain balance and positioning when blockers get into his frame. Understands angles to the ball, but still learning shortcuts through the gaps. Flies after the ball with reckless abandon failing to come to balance as a tackler. Has habit of lunging into arm tackles rather than using feet to work into better tackling position. Missed 11 tackles this year. Tore ACL and MCL in his bowl game and his rookie season is in doubt.	Derrick Johnson	In this day and age of "tweeners" being labeled "hybrid" players, Smith is the rare commodity who is truly hybrid in the sense that he has the athleticism, speed and physical makeup to play any linebacker spot in either the 3­-4 or the 4-­3. Smith was productive but slightly miscast in the middle of the Notre Dame defense and is better suited to play in space as a 4­-3 outside linebacker. However, his length and upfield burst could draw the attention of a 3-­4 team looking to transition him into a rush linebacker while utilizing his rare cover skills.	"He reminds me so much of DJ (Derrick Johnson) when he came out. Same frame, same speed and same playmaking ability. Both of those guys are made for the pro game." --­ Former AFC defensive coach	43	7.16000000000000014	jaylon-smith	\N
