2555329	Myles	Jack	13	73	245	10.25	One of the most versatile players in college football the past three seasons, Jack earned a reputation as a dynamic defender and a contributor on offense. In fact, he earned both the Pac-12 Offensive and Defensive Rookie of the Year award in 2013, as well as being named finalist for Paul Hornung Award as the nation?s most versatile player. A second-team All-Pac 12 defender as a freshman (75 tackles, two interception, 11 passes defended), he had seven rushing touchdowns on the year as well. Pac-12 coaches voted him second team all-conference again in 2014, as he made 88 tackles, eight for loss, intercepted one pass and broke up seven others. He also contributed as a runner, as well, carrying the rock 28 times for 113 yards and three scores. Jack?s junior year was stopped short by a knee injury three games in, though he looked like he was on the way to a fantastic season before the malady occurred (15 tackles, interception). Despite the injury, Jack announced he had "done enough" at UCLA and wanted to be compensated for his play -- so he declared for early entry in the 2016 NFL Draft. Considering that his mother insured Jack against injury after his freshman season, it's not surprising that economics won the day in Jack's decision.	Ultra athletic and can get to the rock from any position on the field. Former running back with speed to run down crossing routes and head off running backs exploding around the corner. Adequate instincts with above average reaction off the snap. Races downhill after the snap and can weave from gap to gap with blazing lateral quickness. Able to weave through and around traffic in relentless pursuit. Plays with desired pad level and leverage. Uses hip explosion to strike on the rise with a hammering blow at the point of attack. Can jar offensive linemen off­-balance with his strikes. Comes off of blocks quickly. Stepped in and was "the dude" from Day 1 at UCLA. Physical and active with alpha qualities on the field. Offers tremendous versatility for creative defensive coordinators. Has the juice to be an edge rusher in sub-­packages and can fit into any 4-­3 linebacker spot at any time. Has played safety and running back at UCLA. Has the strength, speed and athleticism to cover tight ends, running backs and some slot receivers. Plays with frenetic energy and is always looking to get his licks in.	Doesn't have prototypical linebacker frame. Lower body build is more like a running back and doesn't have ideal length. Will take some challenging routes to the football at times. His excitable brand of play will need more control in the pros. Suffered torn anterior meniscus that ended his season in late September. Medicals will likely determine draft stock.	NaVorro Bowman	Upper echelon explosiveness with the desire, speed and aggression to find his way into play after play. While UCLA asked Jack to do a little bit of everything, an NFL team is more likely to simplify his tasks and set him into attack mode to maximize his outstanding physical traits. If he bounces back from the knee injury, Jack could become a high-­end talent early on in his career.	"I wouldn't get cute with him. I would stick him at WILL and just let him be a free running chaser. He has the speed to get to everything and his cover talent will set him apart." -- NFC executive	52	7.5	myles-jack	\N
