2555332	Connor	Cook	1	76	217	9.75	Cook was the most intriguing senior quarterback prospect heading into the 2015 season, and he did not disappoint in his final campaign. He had already secured a place among the best quarterbacks in MSU history, throwing for nearly 6,000 yards, and tossing 46 touchdowns versus 14 interceptions in his sophomore and junior years -- garnering second team All-Big Ten honors both seasons. In 2015, he captured the Johnny Unitas Golden Arm Award and Big Ten Quarterback of the Year Award, leading the Spartans to a spot in the College Football Playoff by throwing for 3,131 yards and 24 touchdowns (throwing seven picks). Cook completed just 56 percent of his passes as a senior, however, down from 58.7 percent and 58.1 percent the previous two years. The Ohio native also fought off a shoulder injury, missing the win over Ohio State, but returning to help his team win their second Big Ten championship in three years. Cook won the MVP award in both the 2013 and 2015 Big Ten Championship Games.	Four-year starter who has shown consistent improvement and added new elements to his game each year. Can operate with a high level of confidence and efficiency. Worked under center and plays with good foot quickness in his drops. Shows good anticipation for developing windows and effective with timing routes. Will continue to scan and re-­scan thru targets when on the move. Reads safeties early and rarely takes shots downfield that safeties can get involved with. Comfortable operating on the move. Throws in rhythm and with accuracy when rolling right. Plus arm strength with compact, lightning quick release. Able to make big boy throws with pace into difficult, dangerous windows. Will stand in and take the hit to challenge man defender with a deep shot. Attacks edges of end zone with touch throws. Didn't shrink away from duties when asked to run the ball. More battle tested than any quarterback in this draft.	Habit of throwing short passes with too much pepper. Accuracy is a major concern. Often caught flat- footed in the pocket and appears willing to launch throws without proper balance or step to target. Open front hip causes him to spray outside frame of his intended target. Sees throws come open but won't always cut it loose. Can struggle mightily when forced off of his first option. Misses opportunities to adjust protection pre-­snap. Gets locked in on shotgun snap and misses signs of blitzers sneaking forward. First instinct versus blitz is to go up top rather than finding easier, short completion. Gives little effort to sell play­ fakes even on run downs. Scouts question his field demeanor and leadership in adverse times. Failed to rise to the occasion in 2015 Big Ten Championship Game or playoff game against Alabama.	Brian Hoyer	As a four-year starter, Cook has the big game experience and the production from a pro-­style attack that should warrant early consideration.The concern is that his short and intermediate accuracy has never shown the improvement and consistency that scouts expected to see. His inability to take over in big games this year could hurt his cause. Cook flashes the potential of an NFL starter, but he has the makeup of game manager over playmaker.	"He has all the pieces but he's never put the puzzle together. Coordinators and quarterback coaches always think they can fix those kinds of guys so they fight the hardest for them in the draft rooms I've been in." -- Former NFL GM	34	5.84999999999999964	connor-cook	\N
2555333	Corey	Coleman	4	71	194	\N	Coleman grew up in a tough Dallas neighborhood playing football in the streets, with a father who is currently serving prison time for felony cocaine distribution. But with the guidance and hard work of his mother, Cassandra Jones, as well as his godfather, former Baylor and NFL star defensive back Ray Crockett, Coleman fulfilled his potential as a playmaker at the college level. As a redshirt freshman, Coleman started 10 games in head coach Art Briles' offense, catching 35 passes for 527 yards and two scores, as well as averaging over 28 yards per kickoff return. His sophomore season started late, as he missed the first three games of the year with a hamstring injury, but finished strong. He was named second-team All-Big 12 (first team by the media) after covering 1,119 yards and scoring 11 times on just 64 receptions. Most importantly, Coleman came up big at the right times (15-224, TD vs Oklahoma, 7-150, TD vs Michigan in Cotton Bowl) ... but that was just a hint of things to come. Coleman won the Biletnikoff Award as the nation?s top receiver in 2015, along with unanimous All-American and first-team all-conference honors, leading the country with 20 touchdown receptions (74-1,363 receiving for the year). He missed the team's Russell Athletic Bowl win over North Carolina after having sports hernia surgery in December in order to be ready for the run up to the 2016 NFL Draft.	Instant blur off the snap. Feet turn over at a blinding pace and he devours cushion before cornerbacks know what hit them. Able to get over the top of every corner he faced and demands safety help over the top. Works back to the ball. Explosive leaper with ability to climb ladder and win the 50/50 ball and body control to secure the acrobatic catch. Touchdown maker finishing 2015 with 20 receiving touchdowns. Smooth, speedy stems to the post will be difficult to mirror and match for NFL cornerbacks. Easy route adjustments in space. Defenders who try to jam and miss pay the iron price (touchdowns). Able to make tacklers miss in tight spaces. Has experience as ball carrier and punt returner. Heavily targeted (39 percent) in Baylor's high­-flying attack.	Does his best work from outside the numbers, but lacks desired NFL size to play outside. Allows cornerbacks to leverage him against the sideline on deep throws. Takes longer than expected to gear down for comeback routes after hitting top speed. Ran limited number of simple routes. Hands are a concern. Fails to catch away from his body. Dropped 10 passes for a drop rate of 11.9 percent. Loses focus and concentration on routes that work towards the middle of the field or when he senses defenders are closing in. Had sports hernia surgery that forced him to miss his bowl game.	John Brown	Dangerous vertical talent with the ability to get over the top of defenders who fail to recognize his blazing quickness off the line of scrimmage. Coleman can get instant separation to create favorable passing windows and is one of the top playmakers in this draft. Coleman's issues with drops near the middle of the field could be a concern if teams see him next as a slot receiver due to his lack of size. Regardless, he can line up outside and win and he offers immediate punt return help.	\N	10	6.09999999999999964	corey-coleman	\N
2555334	Jared	Goff	1	76	215	\N	Instead of following the path of his father, Jerry, to major league baseball (played catcher for three teams over six seasons), Goff starred as a high school quarterback in the Bay Area. Cal coaches put him right into the fire in 2013, and he answered the challenge as the school's first-ever freshman opening weekend starting quarterback. The honorable mention All-Pac-12 pick (18 TD, 10 INT) set school records for passing yards (3,508), passes completed (320), and passes attempted (531) on a 1-11 team lacking great talent. He suffered an injury to his throwing shoulder in the "Big Game" against Stanford that year, but managed to return for the 2014 spring game. In fact, he started all 12 games as a sophomore, completing 62.1 percent of his passes for 3,973 yards and 35 touchdowns against just seven interceptions. Goff capped his career at Cal with a first team All-Pac-12 season, starting every game and setting conference records with 4,719 passing yards and 43 touchdowns on the year. The Bears also won their first bowl game since 2008 when Goff threw for 467 yards and six touchdowns when they took out Air Force in the Armed Forces Bowl. Even before that victory, however, Goff decided to move on to the professional ranks after the season as one of the top quarterback prospects for the 2016 NFL Draft.	Quality arm. Makes all the throws and can sling the deep out with velocity and accuracy. Clean release and snaps throws off with flick of the wrist. Drives hips through his release for extra heat. Pocket mobility and poise showed improvement from 2014 to 2015. Maintains proper footwork and readiness to throw as he slides inside the pocket. Speeds up internal clock when he feels pressure or recognizes blitz. Pocket climber. Able to run out of trouble rather than into it. Looks the part of a confident, first round quarterback when working from a clean pocket. Sells his play ­fakes with purpose and draws linebackers forward. Has learned to expedite his throws from off­-balance angles due to pocket pressure. Will throw receivers open in tight quarters. Has excellent trajectory and pillowy soft touch on touch throws down the field that give receivers a chance to make plays. Showed substantial growth with his willingness to attack intermediate areas of the field and did so with accuracy and relative success. Completed an impressive 43.8 percent of his deep throws. Competes on third and long seeking out first downs over check downs.	Hits a rough patch with accuracy from time to time. Sails throws over intended targets especially early in games. Has spots where he makes receivers work too hard on easy throws. Spent 99.8 percent of his pass snaps from pistol or shotgun this season. Will likely need to orient himself with NFL footwork from under center. Rhythm passer who benefited from the up­tempo and "quick game" of Cal's Bear Raid offense. Has to learn fine line between getting ball out and rushing throws. Able to escape pocket, but isn't a proven finisher when on the move. Fumbled the ball 24 times over the last three years losing 11. Sacked 81 times over three years. Internal clock and poise will need to be monitored closely. Several of his interceptions came when he failed to read zone defenders underneath drifting up to challenge the throw.	Matt Ryan	While Goff is a little leaner in the lower body than teams might like, he has good size, an NFL arm, advanced pocket mobility and the field demeanor of a franchise quarterback. His accuracy and decision making will suffer from occasional lapses, but he displays the tools to become a good starting quarterback with time.	\N	47	6.55999999999999961	jared-goff	\N
