2555398	Josh	Woodrum	1	75	231	9.25	As a redshirt freshman, it look Liberty coaches exactly two games to stick Woodrum into the fire. In the third game of the 2012 season, he took over the starting job and didn't let go (save two games in 2014 he missed with an injury). Now he?s the Flames' career record holder in passing yards (10,266), completions (833), and attempts (1,304). The three-time second team All-Big South selection and team captain is an efficient passer, throwing for 61 touchdown versus 30 interceptions in his career. The Flames were only 6-5 under head coach Turner Gill in 2015, but Woodrum's play help them beat two top 10 teams at home in Montana and Coastal Carolina, the latter victory closing out the quarterback?s collegiate career.	Has necessary NFL size. Steps and drives his throws. Can put the ball on top of receivers with some pace. Accurate with blitz reads and gets ball to hot reads quickly. Can sense when corners are looking to jump routes and will pump fake his way into a cleaner throw. Has enough arm to operate in a more aggressive, vertical offense.	Stiff and limited outside of the pocket. Has wind­up with a short­-armed release. Aims his throws. Drive accuracy is marginal. Over­-the-­top release with downward trajectory creates low, challenging catches. Lacks consistent accuracy and touch. Panics and rushes throws when he sees blitz coming. Lacks improvisational thinking. Slow to see throws come open over the middle and will run receivers into traffic.	\N	Woodrum has enough size and arm to get a scout's attention, but his average accuracy and lack of touchdown production relative to his passing attempts is disappointing. Woodrum might be worth grooming, but he is a pocket passer who is missing the field vision usually associated with those types of "stash" prospects.	\N	262	4.79999999999999982	josh-woodrum	\N
2555399	Keyarris	Garrett	4	75	220	\N	Garrett looks the part of an NFL receiver, and is the nephew of former Baylor and Atlanta Falcons receiver/return specialist David Mims (whose son, David Mims II, is a 2016 draft prospect out of Texas State and played with Garrett in high school). His career with Tulsa has had its ups and downs, starting with an injury-filled freshman campaign (six games, two catches for 10 yards), but he bounced back by earning second-team All-Conference USA in 2012 (67-845, nine TD receiving). Unfortunately, Garrett couldn?t build on that momentum, losing the 2013 campaign lost to a compound fracture in his left leg suffered in the second week of the season (7-68 receiving). His first year back from the injury was good enough to get him back on NFL scouts radars (47-698, five TD, missing two more games due to injury). He fulfilled his promise in his final year with the Golden Hurricane, leading the nation with 1,588 receiving yards and finishing in the top ten with 96 receptions while scoring eight times. Garrett garnered first-team All-Conference USA accolades for his efforts.	Long­-limbed and tall with sinewy build. Extreme arm length providing unique catch ­radius. Can go up and high-­point the ball over most cornerbacks he faced. Able to stack cornerbacks and keep them out of the deep throw once he gets over top of them. Long strides and build­up speed seems to catch cornerbacks off guard on vertical routes. Had 28 catches of 20-plus yards in 2015.	Long legs hinder get­-off against press. Takes awhile to get into his routes and is unable to sink hips and explode out of his breaks to create separation. Has extremely small hands for a receiver his size. Charged with 13 drops over last two years. Struggles mightily to finish contested catches. Routes are basic and somewhat sloppy underneath. Too often waits on throws rather than working back to them.	Rodney Smith	Garrett's production combined with his exceptional length should catch the eyes of NFL general managers right off the bat, but tape study exposes his issues with route quickness underneath and securing contested catches. Garrett probably won't post a blazing 40-yard dash at the combine, but he does have some vertical talent and will have to prove to teams that he can become a consistent finisher and a big-play threat in order to become an NFL contributor.	\N	118	5.19000000000000039	keyarris-garrett	\N
2555400	Maliek	Collins	10	74	311	9.5	Not only was Collins an outstanding football player at Kansas City Central High School (first-team all-state with 43 tackles for loss and 15 sacks as a senior), but a championship wrestler who won a state title at 48-0 in his final year. That combination is gold to NFL scouts, who love defensive linemen who have used their hands to grapple on the mat as well as the gridiron. Collins contributed in his first year on campus in 2013, playing all 12 games and starting the team's bowl game (12 tackles, two for loss, one sack). His star power began to shine in his sophomore year, garnering second team All-Big Ten accolades and team Defensive co-MVP with 45 tackles, 14 for loss, and 4.5 sacks. Though he started 12 of 13 games in 2015, Collins' production dropped: 29 tackles, seven for loss, 2.5 sacks. Big Ten media members and coaches alike still felt that he made enough plays to earn third-team all-conference honors.	Explosive get­-off with good pad level. Has exceptional lateral movement and overall athleticism for the position. Moved around defensive line as rusher and allowed to stand to maximize athleticism as twister. Good coordination between hands and feet. Strong jump­ step and club move inside is his go-­to rush. Flashes an impressive ceiling when it's clicking for him. Initial quickness opens door for disruption. Plus motor with active hands.	Has very little scheme or position flexibility. Ends up on the ground all the time. Impact production doesn't match the athletic ability and talent. Square rusher missing hip swivel and upper body turn to improve penetration. Comes flying in as pass rusher on twists, but doesn't have workable counter­attack ready. Unable to stack and anchor against double teams. Doesn?t have play strength to fight back against redirect blocks.	Henry Melton	Three­-technique with impressive athleticism and movement skills, but a lack of play strength to hold up at the point of attack. Collins needs to play