2555403	Mekale	McKay	4	76	207	9.5	McKay, a former high school hoops star who received interest from Louisville and Kentucky to play that sport, transferred from Arkansas after his freshman season to Cincinnati to be closer to an ailing grandmother. The NCAA allowed waived the transfer year in his case, so he was able to play immediately for the Bearcats. He made a solid contribution to the Razorbacks in his only season there, starting 10 times and catching 21 passes for 317 yards and two scores. All McKay did in the wide-open UC offense was average over 30 yards a catch (16-485) with seven touchdowns in 2013. His junior (44-725, eight TD) and senior (27-507, two scores) seasons displayed similar big-play ability to NFL scouts despite his playing for a team that spreads the ball around to six or seven receivers every game.	Gets the most out of his 6-foot-3 frame when the ball is in the air. Uses well-timed leaps to go up and over smaller defenders and has a feel for the "post-up" game. Clever hand usage to create late separation on deep throws. Works his way back to the catch. Able to accelerate upfield quickly off of his stutter-step release versus press coverage. Willing to stick his nose in as a blocker and has the frame and hand placement to wall defender off and away from making the play.	Production took a dive in 2015 even when healthy. Route running is dull, lacking tight, crisp cuts. One-speed routes put cornerbacks at ease and allow them to crowd the routes. Needs to do better job with vertical sell to back defenders off. The struggle is real if he doesn't get clean release off line of scrimmage. Once defender gets into his chest, it is usually over. Hands have been consistently inconsistent with a drop rate of more than 11 percent for his career.	Dezmin Lewis	McKay was a "one to watch" type of prospect headed into 2015, but failed to build on that buzz this season. While his size is appealing and could get him drafted if he runs a good 40-yard dash, his potential issues against press coverage combined with below average hands could be quite a stumbling block.	"Don't like the hands, don?t like routes and I don't think he plays as fast as his timed speed. He should be better than he was this year." -- NFC regional scout	56	5.05999999999999961	mekale-mckay	\N
2555404	Nila	Kasitati	6	75	317	10.5	Samaje Perine set a FBS record with 427 yards rushing against Kansas in 2014, in part thanks to the blocking of Kasitati (pronounced kah-sih-TAH-tee). The big man pulled around the left side from his right guard position to cut off inside defenders, drove his man off the ball, or used his feet to seal the hole for Perine to bull through. He was just a part-time starter as a junior, though he still received honorable mention All-Big 12 notice. Kasitati was named first team all-conference in 2015 after starting all 13 games at the right guard spot. His medicals will have to check out at the combine for him to be drafted in the middle rounds, as he had surgery on a heart arrhythmia in the summer of 2012.	Thick, strong legs with broad shoulders. Has some initial power and ability to match the challenge when lined up against a player with strength. Looks for work and blocks through the whistle. Plays with toughness and some nasty. Able to pick up games by defensive linemen and isn't easily spooked by blitz bluffing linebackers. Maintains his base when mirroring in pass pro. Hand placement is generally good. Patient in pass sets willing to wait for rusher to make his move rather than lunging after him.	Can be very slow out of his stance. Marginal lateral quickness makes for inconsistent cross­-face blocks and short pulls. Arm length looks like an issue on tape. Needs to play with more pop in his hands. Block sustaining would benefit from bringing his feet and crowding defender after contact. The further away from home base he is forced to move, the more limited he becomes. Straight-line blocker with limited change of direction ability.	\N	Steady right guard with an NFL-­ready frame and good toughness for the interior. Kasitati has the power to stalemate his base blocks and secure his down ­blocks, but he has some athletic limitations that could limit his scheme fit. Kasitati may or may not be drafted, but he has enough ability to compete for a backup spot on an NFL roster.	\N	17	5.12000000000000011	nila-kasitati	\N
2555405	Peyton	Barber	2	70	228	9.375	As a freshman, Barber was diagnosed with a learning disorder that, along with ADHD, had hampered him since middle school. Since his father had the same issue, Peyton received the support he decided both from his family and the university tutor system and did well in the classroom. He only saw the field in six games as a redshirt freshman in 2014, running the ball 10 times for 54 yards. But after a sophomore season where he chugged out 1,017 rushing yards and 13 scores (on a workhorse-like 238 carries), Barber decided to follow the path of his second cousins, Marion and Dominique Barber, to the NFL.	Good thickness through his lower body with an ability to drop his pads and hit it downhill when he's near the end zone. Has vision to recognize running crease development. Can weave from cut-to-cut on second level. Flashes good lateral agility to jump­-cut his way into better running lanes when interior traffic is a problem. Intelligent with ability to learn NFL playbook quickly. Makes sound decisions in blitz pick­ups. Needs technique work, but has capability to handle himself in pass protection. Had the lowest "stuff rate" (rushes for 0 yards or less) of any of the top runners in the SEC at 10.1 percent (Leonard Fournette was 15.3 percent).	Entirely too much dancing when approaching line of scrimmage. Will make juke­-step rather than trusting the crease and mashing the gas downhill. Grinder with limited second level shake to keep the run going. More elusive near the line of scrimmage than in open field. Needs to play with greater decisiveness on the next level. Better pre-­cut movement can help him set­up blocks more effectively. No "wow" factor.	Josh Robinson	Redshirt sophomore who came out early, in part, due to depth of next year?s draft class at running back. Barber proved to be steady and productive with plus vision and a nose for pay dirt, but was missing the decisiveness and explosion that teams like from featured backs. Barber has the size and enough wiggle to make an NFL roster, but his draft value might be determined by his ability to help on special teams and on third downs.	\N	90	5.12000000000000011	peyton-barber	\N
