2555408	Roberto	Aguayo	18	72	207	9.875	What do you do for an encore after winning the Lou Groza Award as the nation's top kicker? How about lead the nation in field goal percentage one year, and then become the first three-time All-American to play for the 'Noles since Deion Sanders? Not bad. Among his other accomplishments, Aguayo was a major player in the team?s 2013 national championship, setting FBS records with 157 points scored and 94 point after tries without a miss. He also made 21-of-22 field goal attempts on the year. The three-time first team All-ACC pick by league coaches set a conference record by making 198 straight extra points ? every one in his storied career. Aguayo led the NCAA in field goal percentage in 2014, making 27-of-30 attempts, though he fell off a bit as a junior (21-26, just 5-for-10 from 40 or more yards away). He had 47 touchbacks in 84 kickoffs in 2015 (56 percent, up from 51 percent in 2014 and 37.5 percent in 2013), presenting leg strength NFL special teams coaches covet.	Was Mr. Automatic during Florida State's successful run from 2013­-2014 and connected on 88.5 percent of his field goals during his career. Never missed a field goal from 39 yards and in during his three years at Florida State going 46-of-46. When it's time to tackle, he leverages returners against the sideline and has speed and athleticism to make the tackle. Leg strength on kickoffs improved with each year. Has outstanding 4.09 kickoff hang time. Unfazed by the moment.	Saw his accuracy dip in 2015. Made just 5-of-9 field goals from 41 yards and beyond. Will occasionally lose track of a kickoff and knock it out of bounds. Only attempted six kicks of 50-plus yards during his career. While quality of kickoffs have improved, still doesn't have a booming kickoff leg.	Graham Gano	Burst onto the college scene by winning the Lou Groza Award as a redshirt freshman and performing at a high level during the Seminoles' run under Jameis Winston. Aguayo is considered an accurate, clutch kicker but with average leg strength. Aguayo is the first kicker to declare early for the draft since Sebastian Janikowski and is expected to be drafted, though not as early as "Seabass" was.	"I had our special teams coach watch tape on him after our season was over and he really liked him. It may be time for us to upgrade board." -- AFC scout	3	5.5	roberto-aguayo	\N
2555409	Ryan	Malleck	5	76	247	9.375	Though never a No. 1 option in the Hokies' offense, especially the explosive Bucky Hodges earning touches of his own the past couple of seasons, Malleck presents enough ability to make a go at a professional career. He was a starter for the final 25 games he played, contributing as a pass receiver in both his junior (24-195, two TD) and senior (21-289, two TD) seasons. Malleck had hoped to be a largest factor in the passing game in 2013 after a redshirt sophomore year where he started seven times, catching 17 passes for 174 yards, but a torn left rotator cuff and labrum in preseason practice sidelined him for the year.	Intelligent against zone coverage. Sinks into quality soft spots and uses strong, reliable hands to finish the catch. Has had just one drop over his last two seasons. Uses body to shield man coverage from the throw. Aggressive runner after the catch. Not a bulldozer as a blocker, but gets into his target and shows some block sustaining potential.	Nothing stands out with his burst off the ball and he takes too long out of his breaks limiting ability to separate. Doesn't have blocking power to balance out his below-average play speed. Will need to play with stronger lower half as an NFL run blocker.	\N	Has the size to be an NFL "Y" tight end, but needs to keep working on his blocking since that will be how he earns his chance on the field. Malleck is competitive, if limited, in the passing game and could hear his name called on the third day if he puts together a decent combine.	\N	28	5.16000000000000014	ryan-malleck	\N
