2555411	Steve	Longa	13	73	241	9.75	Growing up in Cameroon, Longa's first love was world football. But upon reaching the U.S., he gave American football a try. By the time he left Saddle Brook High, he was a prized recruit. Four years later, he's among the best linebackers in the country. As a redshirt freshman, Longa started all 13 games at middle linebacker for the Scarlet Knights, sharing the team's Defensive MVP honors (123 tackles, 7.5 for loss, three sacks, two forced fumbles, four pass break-ups). He moved to the weak side in 2014, once again leading Rutgers with 102 tackles (4.5 for loss, two sacks) and stayed at that position for an honorable mention All-Big Ten junior season (117 tackles, five for loss, two sacks). Having put up three 100-tackle seasons and seeing the departure of his head coach, Kyle Flood, Longa declared for the 2016 NFL Draft as an early entrant.	Has looked for action from his first day on the field. Notched over 100 tackles in all three years at Rutgers (338 total). Has four contests with 10 solo tackles or more this season. Flows downhill and takes efficient angles to running lanes. Collides squarely with target and wraps up. Quality finisher with a high winning percentage as a tackler near the line of scrimmage. Allowed just two broken and seven missed tackles all year. Has nose for run play development that helps him stay ahead of climbing linebackers. Motor never turns off.	Undersized linebacker with marginal play strength and frame. Has to stay punch-­ready to stay clean or he can get smothered by size. Has to work overtime to disengage from blocks. Half-strider missing plus chase speed to walk down runners turning the corner. Bites down hard on play-­action. Inconsistent in man coverage and allows too much catch space from zone. Might lack gap­ control necessary to play in the middle.	Mike Hull	Downhill attacker with a nose for the action. If he doesn't put together exciting combine test scores, teams will have to weigh his consistent production and ability as a tackler against his lack of size and coverage skills. Longa could factor in as an eventual starter at some point, but he might have to prove himself on special teams early in his career to earn his initial roster spot.	"I don't think he's going to test all that well at the combine and his size will work against him, but I love his toughness and production. He's a backup with some special teams ability, but it wouldn't shock me if he ended up working his way into a starter's role at some point." -- NFC director of scouting	25	5.26999999999999957	steve-longa	\N
