2555412	Trevone	Boykin	1	72	212	9.375	One of the most electric players in college football the past two seasons, Boykin was a 2014 Heisman Trophy finalist after earning consensus second-team All-American notice and Big 12 Offensive Player of the Year (3,901 passing yards, 33 touchdowns, 10 interceptions; 707 rush yards, eight rush touchdowns). He again excelled as a senior, earning second-team Walter Camp All-American honors and second team All-Big 12 accolades after finishing among the nation?s leaders in several categories (3,573 passing yards, 31 touchdowns, 10 interceptions; 612 rushing yards, 10 rushing scores) despite missing time with an ankle injury. Boykin was also a finalist for the Davey O'Brien (2014, 2015), Manning (2014, 2015), Unitas Golden Arm (2015), and Walter Camp Player of the Year (2014) awards during his illustrious career. Unfortunately, Boykin's career at TCU ended on a sour note, as he was arrested for punching an officer during a bar fight in San Antonio, where he was supposed to lead the team in the Alamo Bowl against Oregon. He was suspended for that game due to the incident (though the Horned Frogs came back from a 31-0 hole to win 47-41), and will have to answer to NFL teams about his lapse of judgement.	Quick ball­-handling with arm talent to get the throw out cleanly and accurately from a variety of arm slots. Generally throws with necessary ball placement and hits what he aims for. Has deep ball arm to fling it 60 yards off his back foot and can rip it into a tight window underneath. Throws with some anticipation and touch. More pocket elusive than any quarterback in this draft. Absolute Houdini who can escape the most precarious situations and escape with chunk rushing yardage or a completed pass. Has 25 rushes over 15-plus yards over last two years.	Falls below desired height for NFL quarterbacks and hand size is right on borderline. Fumbled 19 times over last three years (but lost just four). Tends to stick with pre­-snap decision