2555414	Willie	Henry	10	75	303	10.875	Though Henry had 10 sacks playing for Ted Ginn, Sr. at powerhouse Glenville (Ohio) High, he was not highly regarded in recruiting circles. Each year we played for the Wolverines, however, he showed the improvement NFL scouts like to see when evaluating a prospects "upside." In 2013, Henry was a strong contributor, starting six times and making 32 tackles, three for loss. He started six times again the next year, being credited with 20 tackles, 5.5 for loss, three sacks and an interception. Henry began fulfilling his potential during his final year in Ann Arbor, starting nine games and earning honorable mention All-Big Ten honors, racking up 34 tackles, 10 for loss, and tying for the team lead with 6.5 sacks. After talking with former high school and college teammate Frank Clark, who was a second-round pick of Seattle in 2015, Henry decided it was time to leave for the NFL.	Comes off snap with low pad level and is usually the leverage winner. Has strong base and lands heavy-handed strike with initial punch to jar blockers. Powerful enough to stack and 2­-gap. Plays with good football awareness and senses trap blocks coming. Has a good feel for down ­blocks and double teams, and can brace up to limit their effectiveness. Well versed in twist game with effective picks and quickness to come off pick and attack the quarterback. Big closing burst to get home when he smells quarterback. Finished season with 6.5 sacks. Surprising upfield burst when allowed to rush from defensive end.	Can be undisciplined pre-­snap with five encroachment penalties this year. Drops head and eyes off the snap and plays with too much waist­-bending upon initial contact. Needs to unlock his juice off the snap to control neutral zone and make more tackles for losses. Cut blocks chop him down with ease. Plays with turned shoulders and narrow base when flowing with run plays which allow blockers to wash him down. Needs a more varied rush attack.	Star Lotulelei	