2555415	Austin	Hooper	5	76	254	10.625	Stanford has become "Tight End U" over the past few years, with former Cardinal contributors Zach Ertz, Levine Tiololo, Coby Fleener and Jim Dray enjoying good NFL careers. Hooper's next in line, leaving for the pros after his redshirt sophomore season. His father actually played at San Diego State, but his uncle, Greg, suited up for Stanford as a fullback from 1979-1982. Those genes were obvious during his two years on the field, first as a redshirt freshman in 2014 where he earned Freshman All-American and second-team All-Pac-12 honors (40-499, two scores). He helped Stanford win a conference championship in his second season, garnering several honors (Mackey Award finalist, third-team AP All-American, first-team All-Pac-12) by catching 34 passes for 438 yards and six touchdowns.	Has capability of playing in­line or as move tight end. Build-up speed allows him to threaten Y-­seam from off line of scrimmage. Hands catcher with excellent hand­-eye coordination and can go get the rock in traffic. Shows enough burst to create separation from linebackers and safeties over the top. Does an adequate job of shielding defenders from the pass and posting them up in space. Strong runner after the catch in screen game and will carry defenders with him into the end zone. Willing blocker who comes from program where run blocking is demanded. Latches onto target with centered blow and shows enough strength to sustain. Looks for work downfield as blocker to help spring explosive runs.	Lacks suddenness and crisp feet in his route work underneath. Could be faced with high number of heavily contested catches in short and intermediate routes. Not much of a salesman with his routes and needs more juice from stem at top of his routes. Would improve separation by meeting physical defenders with increased physicality. Hands need work. Was late getting hands catch­ ready and had nine drops over two seasons for drop rate of almost 11 percent. Catch radius just average for his size. Head ducker as run blocker and can lose track of target and whiff from time to time.	Coby Fleener	Will be labeled as a move tight end, but I see him as being more than that for teams looking for a more complete player. Hooper has a frame that should be able to carry another eight to 10 pounds without much trouble, and he shows enough want­-to as a blocker to see him playing in­line when needed. If Hooper can improve his hands and become craftier with his routes, he could become a solid, 10-­year starter in the league.	\N	51	5.75	austin-hooper	\N
2555417	C.J.	Prosise	2	72	220	8.5	Prosise excelled in several ways for the Irish during his time in South Bend. Due to a lack of talent at the running back position, he was asked to tote the ball regularly in spring 2015 practices, running for 64 yards at the spring scrimmage. The Irish made him their leading rusher this fall, as he gained 1,032 yards and 11 scores on just 156 carries (6.6 average). Prosise also caught 26 passes and 308 yards and one touchdown -- but that was a role in which he had experience the past couple of seasons. He actually led all Irish receivers with 17.8 yards per reception in 2014 (29-516, two TD) and was also the team's Special Teams Player of the Year (11 tackles) and had a 50-yard rush for a touchdown in the Music City Bowl win over LSU. Prosise was actually recruited as a safety, but moved over to receiver for his redshirt freshman season in 2013, starting three times, catching seven passes for 72 yards.	Has every­-down size for the position. Patient, gliding runner with a sense for when it's time to hit the gas and go. Has late cut ability to create new yards for himself. Has effective open-field spin move to elude and the play strength to power through lesser tackle attempts. Efficient runner between the tackles. Runs with desired pad level maintains balance through contact. Falls forward in his finishing. Has enough play speed to turn the corner as outside runner. Experience as receiver gives him upgraded route ability as running back. Has opportunity to be effective on all three levels as receiver if matchup avails itself.	Only one year as full-­time running back. Urgency as runner needs an upgrade. Can be slowed waiting for zone-­read mesh­-point, but indecisiveness flowing outside caused some lost yardage. Fumbled five times in 156 carries losing two. Needs to secure the rock against scavengers looking to rip it away at the end of a run. Recognition of blitzes injuries late.	Fred Jackson	Ascending running back prospect with the