2555418	Jordan	Howard	2	72	230	\N	When Alabama-Birmingham decided to shut down its football program before the 2015 season, the Hoosiers found an outstanding player waiting for a new opportunity in Howard. The Alabama native had two very productive years for the Blazers, who stood by him during the recruiting process after he suffered a torn meniscus and a stress fracture in his pelvis during his junior year in high school. Howard earned five starts as a true freshman in 2013 (881 yards, 6.1 yards per rush average, two touchdowns) and then exploded for first-team All-Conference USA honors the next season. He actually set a UAB rushing record with 1,587 yards on a workhorse-level 306 carries in 2014, scoring 13 times. The step up to a Power Five conference didn't faze Howard, as he won over Big Ten coaches for first-team All-Conference honors (1,213 rush yards, 6.2 yards per rush, nine touchdowns; 11 catches, 106 yards, one touchdown receiving). Rushing for 174 yards against a tough Iowa squad, as well as 238 on 35 carries against Michigan, showed he has the talent to succeed at any level.	Showed ability to step his game up against top competition at both UAB and Indiana. Rushed for at least 145 yards in every full game he played. Natural runner who combines tempo with a special feel for spacial relationships. Pro­-ready vision gives him outstanding feel for run lane developments at the line of scrimmage and onto the second level. Consistently chooses best angles and creases for optimal yardage. For a big back, can make himself skinny through tight quarters. Decisive and punishing. Drops pads and accelerates into contact to batter would-­be tacklers on the second and third levels. Drives legs through arm tackles and goes about his work. Hard-­charging when it?s third- or fourth-and-short. Showed potential in screen game as receiver.	Doesn't have sudden one-­cut ability and has to tap brakes to hit it downhill on outside zone runs. One-speed runner. Can be chased down