2555419	Pharoh	Cooper	4	71	203	9.125	Many college football players are lacking in discipline, driving their coaches crazy. Cooper does not have that problem, as he grew up in a military family -- his grandfather and father were Marines, and his brother is a Marine. After winning back-to-back state high school titles in North Carolina, Cooper used his maturity to get on the field right away for the Gamecocks, receiving Freshman All-SEC honors as an all-purpose back and returner (359 kick return yards). Once given a chance to receive regular touches on offense, Cooper excelled, garnering consensus first team all-conference recognition as a receiver in 2014 (69-1,136, 11 TD) and second team honors as an all-purpose back (200 rushing yards, two scores). His production dipped a bit in 2015 (66-973, nine TD), but South Carolina's offense struggled in many ways this season. SEC coaches still named him first team all-conference receiver and all-purpose player for his efforts.	Short but compact and strong. Especially fast with first three steps off the line. Reaches top speed almost instantly. Should blaze his 10-­yard split at combine. Operates with excellent balance and body control at all times. Staccato footwork and seamless change of direction out of breaks opens early passing window. Will break off route and improvise to free space when route is compromised by coverage underneath it. Competitiveness ramps as soon as he hits the grass. Has burst to steam past safety if cornerback takes bad angle on his slants. Strength to play through contact in his routes. Stutter-go release near goal line is difficult to stop.	Has neither height nor length for desired catch radius. Was unable to reach big­-play throws downfield. Contested catches became a chore. Battled focus and concentration drops at one point. Hip tightness creates rounded routes and limited wiggle after catch. The more wrinkles in the route, the less effective Cooper becomes. Relies on straight line quickness over