2555420	Jerald	Hawkins	7	78	305	9.625	Winning a job on LSU's offensive line is no easy task, as head coach Les Miles continually brings in large talents up front. But Hawkins managed to win the starting job at right tackle as a redshirt freshman, even playing on the blind side for an injured La'el Collins in one contest. The Louisiana native started every game at right tackle in 2014, as well, before moving to Collins' left tackle spot this fall. He missed the contest against Ole Miss with an ankle injury, but started the other 12 games in his final season in Death Valley. Despite his pleas to Collins to stay for his senior season last year, Hawkins decided to forego his fourth year on campus to head to the NFL; he's the only Tiger to do so this year.	Long­-limbed tackle with experience on both sides. Slides feet and hips into play-­side positioning after making squared contact on reach blocks and the backside. Flashes power in his paws snatching a portion of defender's frame and maintaining his grip. Plays with good weight distribution and balanced pass sets. Has foot quickness and change of direction for redirect move back inside without much hesitation and brace up his edge. Speedy snap off and search mechanism against twists. Generally well-timed climbs on combo blocks. Uses upward blow with decent hip snap into initial contact in run game. Held his own in snaps against A'Shawn Robinson from Alabama.	Possesses unusually linear build with thin waist for an offensive lineman. Power in base blocks hindered by his narrow drive base. Doesn?t always bring his feet through contact. Overall power and play strength need to improve. Wins early portion of the rep but often gives way to opponents' strength over second half of the snap. Not a natural knee­-bender and misses more than he hits on second level. Doesn't gain enough lateral ground to consistently get to cross­-face blocks and backside cut­off on linebackers. Hands too wide in pass pro set­up leading to slower, wider punch at times. Willing to waist-­bend when pass rusher gets to the edge.	Bobby Massie	Hawkins is a tough evaluation because the length and footwork in pass protection are promising, but issues with bend and body control may be difficult to correct. Hawkins has talent, but his ceiling might be tied directly to whether a team allows him to sit while an offensive line coach works to correct the technical flaws that limit his effectiveness. Hawkins best spot may be right tackle.	"You have to watch him in a few games because he's not asked to do as much in some games as others. In one game you think he looks really strong and then in another game he's kind of all over the place. Some of that is his feet. If he improves his feet he should improve his play strength." -- NFL offensive line coach	91	5.5	jerald-hawkins	\N
2555459	Keith	Marshall	2	71	219	9.375	It was hoped Marshall would be the next great back to play between the hedges. He was the North Carolina Gatorade Player of the Year as a high school senior, rushing for nearly 1,900 yards, and recruiters appreciated that he was the state Class AAAA 100-meter dash champion. Marshall made a great first impression, taking 117 carries as a true freshman for 759 yards and eight scores (he also had 11-91, one TD receiving). Five games into his sophomore season, however, he suffered a torn right ACL against Tennessee and missed the rest of the year (56-246, one TD rushing; 8-111, one TD receiving). He attempted to come back for 2014, but could only play three games (12-24 rushing) because his knee did not heal properly. Ironically, an injury to his teammate, Nick Chubb, made it possible for Marshall to get 68 carries (for 350 yards and three scores) in his final year with the Bulldogs. Instead of petitioning the NCAA for another year of eligibility due to two lost seasons, Marshall decided to move on and try to make his way in the NFL.	Combines size and raw speed. Before knee injuries possessed blazing, third-level speed. Had 12 percent of his runs in 2012 go for 15-plus yards. Has the burst gear and bend to squeeze through constricted run lanes. Tight, efficient footwork for quick lateral cuts before getting run back on track downhill. Makes early tackle attempts miss. Intelligent player who can learn quickly. Limited production in passing game, but able pass catcher.	Doesn't look as fast as before his 2013 ACL tear. Appears to lack confidence as a runner. Hesitant runner through creases like back expecting to be tackled rather than running to daylight. Weight gets too far out over toes causing lack of balance. Misses out on huge runs with inability to shake safety in open field. Missing feel for the rushing track and patience to let blocks develop in outside zone game.	\N	Marshall was a highly recruited running back who flashed massive potential as a freshman but never made his way back up the Georgia ladder due to injuries and incredible depth at the position over the last few years. Marshall could become a lottery ticket for a zone scheme team willing to take a chance that his speed and confidence return with a fresh start in a new location. His ceiling is much higher than many of the Day 3 running backs who could be drafted ahead of him.	\N	83	5.29999999999999982	keith-marshall	\N
2555421	Yannick	Ngakoue	9	74	252	9.5	Born in Washington, D.C., Ngakoue stayed nearby for college after an excellent high school career. He was named the D.C. Gatorade Player of the Year as a senior, racking up 17 sacks and leading Friendship Collegiate to a district title. Nkagoue got his feet wet as a true freshman, making 10 tackles, 4.5 for loss including two sacks, and an interception playing every game as a reserve. His play as a sophomore earned honorable mention notice from league media (37 tackles, 13.5 for loss and six sacks) and portended better things to come. Quarterbacks in the Big Ten did not appreciate his improvement in what proved to be his final collegiate season -- he set a Maryland record and finished tied for second in the country with 13.5 sacks (within 15 total tackles for loss).	Flexible and athletic with a chiseled frame. Produced 45 quarterback pressures and 13 sacks this season. Plays with plus motor. Slippery with ability to find his way into a play even though he's being blocked. Impressive lateral quickness to escape reach blocks and create perimeter contain against the run. Stays low, creeping around the corner before exploding up to the quarterback on twists. Plays with some hip flip around the corner as a pass rusher. Suddenness to unlock a more dangerous inside move.	Needs to improve timing of the snap. False stepper as stand­up rusher and takes five steps to gain five yards when bursting upfield. Pops upright out of his track stance rather than firing up the field. Several sacks the result of extended plays or being unblocked. Engrossed with blocks in front of him and loses track of the ball. Lacks quick shed hand strength or an ability to impact game at the point of attack.	Jackson Jeffcoat	Lacks the desired height and length from an edge player, but does have the athleticism and production teams like. A deep dive into the tape reveals very few "instant wins sacks" and his short strides prevent him from threatening the edge as often as you might expect. While Ngakoue appears to have the traits of an upfield player, he was asked to set edges at Maryland. His production from 2015 will intrigue teams, but he is a work in progress who needs a more developed skill set as a pass rusher if he wants to become a factor in the NFL as a starter.	\N	5	5.38999999999999968	yannick-ngakoue	\N
2555426	Cardale	Jones	1	77	253	9.75	Jones went from relative unknown (outside Ohio) to superstar to backup during his tumultuous Buckeyes career. He signed with Ohio State a semester early after a stellar at career powerhouse Glenville (coached by Ted Ginn, Sr.), redshirted in 2012 and played just 39 plays from scrimmage in 2013 (1-3 passing, 17-128, one TD rushing). But when Braxton Miller and J.T. Barrett were lost to injury before and during the 2015 season, respectively, it was Jones? turn to shine. He came in for Barrett to finish off Michigan, beat down Wisconsin in the Big Ten Championship Game, and then led the Buckeyes to a national title a month later. Jones finished the year completing 60.0 percent of his throws for 860 yards and seven touchdowns against two interceptions, as well as rushing for 296 yards and a score. Head Coach Urban Meyer named Jones the starter after a heated battle between he and Barrett, but Jones? inconsistency caused him to lose the job to Barrett halfway through the season (eight starts, 1,460 passing yards, 62.5 percent on completions, eight TD, five INT; 193 yards, two TD rushing). With Barrett returning for another year in 2016, Jones decided to enter the NFL draft as an early entrant rather than finishing his career at another college.	Great size to see over offensive line and bulk to withstand NFL hits. Pocket passer with as much arm as you need. Generates very good velocity without having to get feet set. Can rip it into tight quarters, challenge field-­side cornerbacks and attack safeties over the top. Almost 11 percent of his pass attempts were 20-plus yard completions. Completed 59 percent of intermediate throws and 41 percent of deep throws. Touch and ball placement on long ball is pro caliber. Can drop feathery, touch throws on fade routes. Has size, athleticism and toughness to call his own number in run game and is a chain mover as a scrambler. Interceptions generally due to overthrows and poor timing over bad decision­-making. Though not yet a strength, did show ability to get through progressions and find third option.	Handed starting job and never owned it. Disappointing accuracy issues with difficulty hitting simple slants. Uncorked interceptions where unrushed pocket throws sailed way over the top of targets. Eyeballs receivers and brings heat from instinctive linebackers and defensive backs. Had issues reading and reacting to zone coverage underneath. Doesn't hold safeties with his eyes. Failed to execute timing throws out in rhythm. Will pump and re­set too often forcing out routes against the sideline. Tends to overthrow near goal line and leave touchdown passes on the field. Saw completion numbers drop almost 30 percent when forced to throw on the move. Below average pocket feel and blitz awareness. Was unable to move from checkers to chess against defensive coordinators.	Logan Thomas	Jones is like a complicated meal that may or may not have all the ingredients present and will likely take a long time to prepare. Will the pay­off be worth the investment of time? Jones has very little starting experience and struggled to adjust once defensive coordinators had time to prepare for him this season. The right quarterback coach and passing scheme could promote rapid improvement and high-end production with his ability to strike downfield, but his issues with consistency and accuracy make the "bust" label a very real concern.	"You want to buy into the size and arm but his accuracy and game management just aren?t there yet. He doesn't even have 300 passes under his belt! Compare him to (Teddy) Bridewater and (Derek) Carr. Blows those guys away with the physical stuff but he can't touch their poise and leadership as young quarterbacks." -- NFL offensive coordinator	37	5.44000000000000039	cardale-jones	\N
