lus defenders. Underthrows were culprit with deep ball accuracy. Not much of a threat with his legs.	Sean Mannion	Veteran quarterback with the desired frame for the position and coming off of his best year yet. Sudfeld tends to push the ball rather than deliver with a clean weight­ shift and follow through, creating inconsistencies with accuracy and velocity. There is some solid tape on Sudfeld that could give NFL teams hope, but issues with making the right reads will work against him.	"I love his size and he made that senior jump that we like to see. He takes you on a ride because one week you really like him and the next time you see him you see a career backup at best. I've got an average backup grade on him, but we'll see what our coaches say about him." -- AFC West scout	31	5.26999999999999957	nate-sudfeld	\N
2555428	Vernon	Adams	1	71	200	9.125	Though short for the position, Adams won numerous FCS honors in three years at EWU, completing 65 percent of his passes for more than 10,000 yards and a whopping 110 touchdowns. He then transferred to Oregon as a college graduate to take over for 2014 Heisman Trophy winner and No. 2 overall draft pick, Marcus Mariota. His final collegiate season did not go as planned, however, as he broke his right thumb playing against his former team in the opener, limiting him for a few games. Adams looked great once healthy (64.9 completion percentage, 2,643 yards, 26 touchdowns, six interceptions for 2015), leading the team to six straight wins. The honorable mention All-Pac-12 pick got hurt again in the Alamo Bowl, where his team blew the 28-0 lead Adams had built to lose, 47-41. Even though injuries kept him off the field most of his senior year, he proved not to shrink against the higher level of competition.	Produced at a high level during his single season in the Ducks offense. Recognizes danger and typically avoids it. Only one of six interceptions due to decision-­making. Shows ability to get through progressions. No hesitation to bounce to next read if he spies too much congestion with primary reads. Throws with adequate touch to all levels. Has foot quickness to depart compressed pockets from variety of angles to extend play and complete passes. Packaged play potential.	Short, light and small hands. High-end yards per attempt slightly misleading due to scheme. Below average anticipation outside of single read route combinations. Field vision marginal. Fails to see early, easy throws. Extended release time waiting for throwing windows to open wide. Forces offensive line into extended pass protection and high sack total (26). Hesitant to challenge secondary between the hashes. Antsy feet in pocket and prefers to leave and look over sitting tight. Has long windup with slightly below 3/4 delivery. Ball placement needs improvement.	B.J. D