2555429	Joel	Stave	1	77	236	10.75	Stave was an all-state pick from the Badger State who stayed close to home and reaped the benefits, eventually becoming the winningest quarterback in Wisconsin history with a 31-10 record as a starter. He started six games as a redshirt freshman at UW, completing 58.8 percent of his passes for 1,104 yards, six touchdowns, and three interceptions. He would have started more games but a broken collarbone suffered in October cost him the rest of the regular season. Stave hit a peak to his career as a sophomore, accepting honorable mention All-Big Ten notice as a 13-game starter (61.9 percent, 2,494 yards, 22 touchdownss, 13 interceptions). His shoulder was injured in the team's Capital Bowl loss to South Carolina, however, which affected him into the next season. Eventually he regained the starting job as a junior, but couldn't connect often enough with his receivers (53.4 percent, 1,350 yards, nine touchdowns, 10 interceptions). Stave bounced back a bit as a senior, completing over 60 percent of his throws for a career-high 2,687 yards and 11 touchdowns, though that total matched the 11 interceptions he threw during the year. He gave NFL scouts something to think about with his effort in the Holiday Bowl win over USC, completing 18 of 27 passes for 217 yards and a touchdown on a big stage.	Looks the part with good size and a pretty, over-­the-­top delivery. Plays in pro-­style offense and is experienced under center. Steps and drives the intermediate throws and ball comes out of his hand with a tight spiral and heat on it. Possesses above average arm strength and was asked to make NFL throws in his offense. Rhythm passer able to throw with timing. Comfortable and efficient on roll outs and bootlegs.	Accuracy and ball placement are hit or miss. Throws at or slightly behind moving targets rather than throwing them open.. Below average pocket mobility. Shows signs of pocket panic dropping eyes at early signs of pressure. Can't win with his legs. Plays with blinders and will make throws with no awareness of safeties lurking. Poor decision making and accuracy on third downs attempting to fit throws into impossible spots.	Tom Savage	Stave has size, a strong arm, loads of experience and plays in a run­-first offense, yet he's produced 19 touchdowns and 22 interceptions over the last two seasons. For all the physical boxes he checks off, issues with accuracy and decision-­making have been too present in his game and fans at Wisconsin let him know about it. Stave throws as pretty a pass as any quarterback in this draft, but very few quarterbacks have been able to overcome his weaknesses and become reliable NFL quarterbacks.	"He's got the physical tools that are going to get him drafted and give him a shot with a team. Coaches who are just seeing him are going to be more excited about him than the scouts who know him." -- NFC executive	40	5.08000000000000007	joel-stave	\N
2555430	Alex	Collins	2	70	217	9.25	It didn't take long for Collins, one of the most highly recruited high school running backs in the country, to make his mark for the Razorbacks. In fact, he was the first true freshman to start his career with three 100-yard performances since Adrian Peterson in 2004. Even though he shared carries with Jonathan Williams in his first two years on campus, Collins rolled up more than 1,000 yards each year (1,026 with 4 TD in 2013, 1,100 with 12 TD in 2014), joining Darren McFadden as the only Arkansas backs to accomplish that feat. With Williams out with an injury in 2015, Collins's carries increased from 204 in 2014 to 271 in 2015 as did his production (1,577 yards, 20 TD). He earned second team All-SEC honors in his final year, finishing behind Heisman Trophy winner Derrick Henry (Alabama) and Leonard Fournette (LSU). One of the toughest runners in college football, Collins made the jump to the NFL after his junior year.	Well-built, durable frame with feet from a wind­up toy. Plays with amazingly consistent and repetitive tempo as a runner. Able to weave in, out and around traffic without breaking his speed or tempo. Has foot quickness and agility to avoid the backfield traffic and the instant acceleration to get the run back underway. Patient and probing while waiting for a crease. Pad level and knee bend are outstanding. Keeps shoulders square to the line and stays low and tight through the hole. Excellent vision on the interior and consistently jukes and side­steps tackle attempts to create additional yardage. Touchdown hog. Plated 32 rushing touchdowns over last three years. Runs with consistent forward lean and always falls forward.	One speed runner. Doesn't play with natural one-­cut stride length and everything comes off stutter-stepping, choppy strides. Feel for outside runs is off. Breaks runs back inside prematurely that still have life along their original track. Can't generate enough momentum through contact acceleration