2555431	Quayvon	Hicks	3	73	259	9.625	In a time where true fullbacks are not used regularly at the college or pro level, Hicks found a good home at Georgia, where he led the way for multiple 1,000-yard rushers. He played primarily on special teams for 12 games in his true freshman season before becoming a part of the offense the following season. Hicks started six games, playing 13, and getting his hands on the ball as a runner (10-72, one TD) and receiver (5-67) as a sophomore. He again started six of 13 games played in 2014, rushing nine times for 85 yards and two scores while catching four passes for 31 yards. His production dropped as a senior (4-9 rushing; 3-34 receiving), but his contributions as a blocker were acknowledged with an invite to the NFL Scouting Combine.	Burly, well-­proportioned frame. Has booming power if he lands squarely as a downhill thumper. Plays with good speed to get out in front as lead blocker. Has experience with short yardage carries and can catch the ball out of the backfield. Former high school defensive tackle with plenty of physicality to his game. Able blocker in pass protection.	Extremely inconsistent with reads on outside zone plays. Showed hesitation and assignment confusion on some snaps. Bulky in space with very average body control and ability to radar in on moving shifty targets. Missed bowl game with a knee injury.	Jalston Fowler	Imposing fullback with enough power to kick­ out defenders and strike linebackers with authority. Hicks' biggest issues appear to be processing his assignment quickly and consistently. With his size and ability to catch the ball out of the backfield, he could get a call on Day 3 of the draft.	"Old-school fullback with size and power. He had a play against South Carolina where he catches it and hurdles over a tackler like he's a five-­star running back. That caught my eye." -- AFC southeastern area scout	83	5.07000000000000028	quayvon-hicks	\N
2555432	Andy	Janovich	3	73	238	9.75	The walk-on tradition at Nebraska is strong, with many players becoming stars after failing to receive a scholarship before arriving on campus. Janovich was an All-Nebraska pick at running back and linebacker, while also winning two state wrestling titles (one at 220 pounds and one at 189 pounds). The Cornhusker staff decided to combine his experience as a ballcarrier with his love of physical play, moving him to fullback. He played in 11 games, starting two, as a true freshman (3-4 rushing, 2-13 receiving) before contributing in 13 games in 2013. Janovich battled through rehabbing a knee injury at the start of his junior season, playing in all 13 games to aid Ameer Abdullah's quest for 1,000 yards and starting the final two. He had his most prolific season as a senior, running the ball 42 times for 265 yards and three scores and catching two passes for 58 yards. Despite the drop in NFL teams looking for true fullbacks, Janovich earned an invitation to the NFL Scouting Combine, possibly due to his special teams process (13 tackles in 2015).	Rare running fullback with short-area wiggle to make defenders miss. Grinds through contact and can break tackles en route to grinding out additional yardage. Might have value as short yardage runner in pros. Runs feet through downhill contact on iso blocks. Can help as blocker in pass pro. Special teams cover specialist with 13 tackles this season. Can play elephant in pros and cover kickoffs. Weight room warrior.	Could be limited by scheme fit. Doesn't have girth teams look for in hammer-­head lead blocker. More of a positional blocker than kick-­out blocker against edge setters. Has habit of ducking head into blocks. Limited experience in passing attack.	Mike Burton	Undersized H-back with the ability to give teams a carry here and there and do enough as a blocker to warrant consideration on the roster. Janovich was an extremely productive special teamer this season and if he can prove himself to be an adequate pass­ catcher, he could find his way onto a roster and get some snaps. Fullbacks and H-backs have limited draft value, but Janovich has a good shot at making a roster once he gets into camp.	"He's a dude! Loves to bang weights and hunt. My kind of guy. They didn't ask him to catch the ball much, but I think he can do it." -- Big Ten scout	16	5.16000000000000014	andy-janovich	\N
