sistently get the corner. Can't stay healthy. Missed 2012 with a knee injury and 2014 with turf toe. Missed time in December of 2015.	\N	While Madden has the size and toughness to intrigue teams, his checkered history with injuries and lack of functional athleticism are a concern. Madden is more of a "get what's blocked" type of back than a creator and might have to be a short yardage worker for now. If his medicals don't check out, it won't matter.	\N	50	5	tre-madden	\N
2555460	Paul	Perkins	2	70	208	\N	Seeing Perkins succeed as a college running back is not surprising, given that his father Bruce (whose first name is actually Paul) played fullback for two years in the NFL and his uncle Don played eight years for the Dallas Cowboys. His younger brother, Bryce, redshirted at Arizona State (where Bruce played) last year, as well. Living up to the family name can be challenging, but Perkins showed great promise as a redshirt freshman by starting six games and finishing as the team's top rusher after athletic quarterback Brett Hundley (134-573, six touchdowns). Hundley didn?t have to run as much in 2014, handing the ball to Perkins 251 times and watching the back go for a Pac-12 best 1,575 yards and nine touchdowns (plus 26 passes to Perkins for 201 yards and two scores). He somehow was only voted honorable mention all-conference for that performance, but coaches wised up in 2015, naming him to their second-team after another excellent season (1,343 yards, 14 TD rushing; 30-242, one TD receiving).	One of the top creators in the draft combining elite vision and a wicked jump­-cut. Can disappear before tackler's eyes and put them on his highlight reel. Shows no directional tendencies with his cuts and can make defenders miss in tight quarters. Decisive when working between the tackles, but can bounce it when warranted. Flashes sudden, 1­-cut ability on stretch plays. Stacks moves on moves. Reliable hands when asked to help in passing game. Willing to stick his nose in against the blitz.	Smallish frame for the big-­boy workload asked of him. Arm tackle attempts cause hiccup in his journey. Runs halted abruptly when tacklers square him up. Could be forced off field in short yardage spots. Missing NFL-­caliber force to run through contact and fall forward. Limited to swings, screens and wheels as receiver. Lacked consistent play speed with his wheel routes. Might lack requisite sand in his pants to be counted on for NFL blitz pickup.	Duke Johnson	If Perkins had more size and play strength to go with his elusiveness, we would be talking about whether he or Ezekiel Elliott would be the first running back off the board. While Perkins' tape is full of ankle-breaking cuts, his draft value will also be determined by his ability to protect the quarterback and stay on the field in short-yardage spots. If Perkins finds the right scheme and team fits for his talents, he could become a high-­end committee back early on.	"Poor man's Jamaal Charles. The tape tells you everything on him. He's not big, he's not fast, he has great feet and he competes. The combine workout won't tell you anything new. I'm interested to meet the kid and see what he's like." -- NFC general manager	52	5.75999999999999979	paul-perkins	\N
2555461	Wendell	Smallwood	2	70	208	9.25	The Big 12's leading rusher in 2015 was Smallwood, in a bit of an upset over bigger names like Oklahoma's Samaje Perine and Baylor's Shock Linwood. He rushed for 1,519 yards and nine touchdowns in 13 games, while also catching 26 passes out of the backfield for 160 yards, in what proved to be his final year with the Mountaineers after filing for early entry into the 2016 NFL Draft. As a sophomore, Smallwood was second on the team with 722 rushing yards and two scores on 148 carries, and contributed 31 catches for 326 yards as a receiver. He had showed promise as a true freshman, as well, (39-221 rushing; 11-132 receiving, one start in 12 games), but he nearly was untracked in the following offseason after being arrested on a warrant for a witness tampering charge. Smallwood was accused of telling someone to recant their statement accusing one of his friends in a fatal shooting case. The charges were officially dropped when his friend pleaded guilty in the murder case, allowing Smallwood to continue his football career.	Hits the crease with proper pad level and can spin off of initial tackle attempt on his way to additional yardage. Attacks his foes with lead shoulder at the end of the run for an aggressive finish. Runs a disciplined track as zone runner using solid vision and steady tempo. One of the sharpest players on the offense. Scans and spots blitzers on the creep and steps over to meet them as a blocker. Possesses exceptional hands as an option out of the backfield.	Can use more beef on his frame to handle the rigors of the NFL. Monotone runner who tends to keep his runs at one speed. Not flashy or particularly creative as a runner. Gets what is blocked and is more of a physical finisher than tackle breaker. Has an extended gear down on outside zone to hit downhill cuts. Average athleticism and lacks the sudden jump cut.	\N	Smallwood changed West Virginia from an "Air Raid" offense to a "ground and pound" attack. Smallwood's tape features few, true flash plays, but the quality runs seem to stack up one after another. His intelligence in pass pro and ability to catch the ball out of the backfield give him an immediate shot as a third-down back, but his combine could determine whether he hears his name on Day 3 of the draft or not.	\N	29	5.12000000000000011	wendell-smallwood	\N
2555462	Kelvin	Taylor	2	70	207	8.25	Talk about football genes ... this Gator followed in the steps of his father Fred Taylor, one of the most productive running backs in Florida and NFL history. It was not surprising that he become the Florida high school record-holder in rushing yards, accumulating 12,121 yards and 191 touchdowns in five years on the varsity squad (yes, he played as an eighth grader). The 2012 Lou Groza High School Player of the Year joined his father in winning the award, becoming the first family duo to do so. Taylor showed glimpses of that talent in a Freshman All-SEC season in 2013 (508 rush yards, four TD) and a sophomore season without a ton of opportunities (565 yards, six TD on 116 carries). He finally became "the man" for the Gators, getting 259 totes and covering 1,035 yards and scoring 13 times while also catching 17 passes for 150 yards. He might not be drafted in the first round, like his father was in 1998 by Jacksonville (ninth overall pick), but Taylor has an NFL future.	Plays the game with advanced understanding of an NFL player's son. Able to find additional yardage on his own with vision and outstanding lateral agility. Sweeping jump ­cut eludes sudden road­blocks. Can squeeze through a narrow patch when needed. Stacks cuts on cuts onto the second level. Has quickness to gain the corner. Never fumbled during time at Florida spanning 486 carries and 510 touches. Understands job requirements as pass blocker and executes to best of his ability.	Shows lack of patience at time failing to press line of scrimmage and open up cutback lanes. Indecisive, at times, when approaching the line and seems to always be looking for the next cut rather than finishing the run. Doesn't have tackle-­breaking power and runs often end at contact. Despite willingness to block, lacks the beef to hold ground against A-­gap linebackers.	Bobby Rainey	Quicker-­than­-fast running back with the vision and footwork to be a creator, but a potential lack of power 