ve an impact on the ground and through the air in Texas Tech's wide-­open attack. Washington is short but compact and certainly does not lack the toughness to transition into the NFL, but issues with drops and ball security could hurt his chances to make a roster if he can't prove to be a kick return option at some point during camp.	"Really competes hard. Glad he got the call at the Senior Bowl and I thought he handled himself well. Size is big concern. He returned kicks early in his career and may have to prove he can do that to add enough roster value to stick." -- AFC South personnel executive	21	4.95000000000000018	deandre-washington	\N
