ressive, it was partially because of his lack of snaps due to Alabama?s rotations. Pettway isn't a premium rusher, but he has NFL toughness and power at the point of attack. Pettway could offer depth as a base end or may be able to add weight over time and transition inside.	\N	88	5.04999999999999982	d.j.-pettway	\N
2555514	Hassan	Ridgeway	10	75	303	9.375	Ridgeway moved from California to Texas when he was 14 and, given the fervor that the Lone Star State tackle has for the gridiron, he found himself suiting up for Friday Night Lights not playing up to that point in his life. It didn't take long for his athleticism to shine, as he earned all-state honors and became a coveted recruit who stayed in-state. Ridgeway redshirted in 2012, then played 12 games as a reserve the following year (13 tackles, one for loss). He started getting after it as a sophomore, starting the final 10 games, making 43 stops and ranking among the team leaders in tackles for loss (11) and sacks (six). Ridgeway lost some time to injuries last fall, starting eight of the 11 games in which he played. He still received honorable mention All-Big 12 notice, however, with 36 tackles, 6.5 for loss, and 3.5 sacks.	Dense, powerful lower half combined with burly upper body. Snap experience at multiple spots along the line. Explodes out of stance and into his downhill charge. Striking athletic ability for a big. Has some change of direction twitch. Sets hard edge with good punch and arm extension to deny blocker's intentions. Grows roots against double teams and fights hard for his spot. Defeats most single blocks. Has play power to step through a blocker's edges with little trouble. Plays with good recognition and quick discard capability to snap down on tackle opportunities. Talented interior pass rusher. Uses coordinated attack with violent active hands and nimble feet. Flashes power to push and quickness to disrupt.	Conditioning has been an issue in the past. Plays hard, but gasses so may need plenty of rotational help. Despite athleticism, range as playmaker is a little limited. Will momentarily lose track of the ball when trying to impose his will on blocker in front of him. Stops flowing outside with play when looking back inside looking to make a play. Hounded by nagging injuries for much of the year. Was hindered by a back issue that arose before the season and then a shoulder injury later. Production didn?t always match the talent on the tape.	Kawaan Short	Ridgeway didn't put together as productive and flashy a junior campaign as he did a sophomore season, but that was due partially to nagging injuries. You can watch snap after snap and clear losses to the blocker are hard to find. Ridgeway has a rare combination of power and athleticism that give him the potential to impact the game on all three downs. His talent could make him the most impactful defensive tackle to come out of this draft, but his floor is lower than some due to concerns over health and conditioning.	"He's more talented than Malcolm Brown was coming out but his conditioning and injuries worry you. With time and money will his weight balloon? Will he be motivated to work in the offseason? He would have benefited by going back to school." -- NFL general manager	19	6.16999999999999993	hassan-ridgeway	\N
2555515	DeVaunte	Sigler	10	75	298	9.875	Sigler's dismissal from Auburn for violating team rules after his sophomore year could have been the end of his career, especially since he didn't play at all in 2013. He worked as a brick mason that year, vowing to make things right for his young daughter. Sigler made the most of his second chance, getting his grades in order and tearing up the Ohio Valley Conference as the league's Defensive Player of the Year in 2014. He also earned second-team FCS All-American honors from the Associated Press after accumulating 36 tackles, nine for loss, 3.5 sacks, an interception and two forced fumbles. Sigler had a setback in his final year on campus, as injuries robbed him of multiple games. Yet, he still was named second-team All-Ohio Valley Conference by making 32 tackles, 2.5 for loss, two sacks and four pass breakups in ten games.	Good feel for double teams. Will widen base and drop his anchor when facing the double. Aggressive twister as pass rusher. Looks to cave in blocker when he's the first man in on a twist. Has good upfield burst as pass rusher and plays with a good motor pursuing plays up and down the field until he hears the whistle.	Had some issues dealing with the power of Auburn's Shon Coleman in the run game. Must work to stay lower rather than give blockers access under his pads. Must learn to play with his hands earlier in the rep. Gets dislodged before he looks to shed rather than punching and controlling. Pass rush consists of just bull rushes. Missed a good portion of 2015 with injuries. Dismissed from Auburn for undisclosed violations.	\N	Sigler has the size, motor and functional play strength to get him into a camp, but he will need to become much better with his hands and do more as a pass rusher to become more than just a camp body. Sigler will need to answer questions about his character and medicals at the combine as well.	\N	248	4.96999999999999975	devaunte-sigler	\N
2555517	Vincent	Valentine	10	76	329	9.625	Valentine's career showed real promise at times, yet was marked by inconsistency and injury. He played in all 13 games as a redshirt freshman in 2013, getting a starting call six times (the first four, and the final two) in order to make 21 tackles, five for loss and a sack. In the Illinois high school all-state pick?s sophomore season, it looked like the consistency was coming as he started 11 times, recording 45 stops, seven for loss, and three sacks in the middle. A knee injury slowed him down during his fourth and final year on campus, limiting him to seven starts, 10 tackles, four for loss, and three sacks. Instead of returning to school to prove himself to scouts, Valentine chose to leave early for the NFL with his diploma in hand.	Burly calves and and thick legs that look like sacks of grain. Proper study requires viewing of 2014 tape when he was healthy. Can sit down and live in his space. Has power to thrash undersized centers right out of the picture. Able to eat up double teams and road­block his run fit when he's on his game. Reactive quickness to turn and snap onto running backs attempting to dart past him. Finished with more career sacks than teammate Maliek Collins.	Carries excessive weight in the middle and lacks desired lean muscle mass for his frame. Could get more from his power with proper hand usage. Scouts question effort level in 2015. Slammed by insiders for a lack of conditioning and practice habits. Missed extensive time due to high ankle sprain.	Darius Kilgo	His draft grade will likely be higher than his 2015 tape would indicate due to a high ankle sprain that limited his overall play and production. Valentine needs to carry more "good weight" and commit to the work that has to be done leading up to the game. If he can do those things, he has enough power and ability to become a backup nose with eventual starter potential.	\N	16	5.21999999999999975	vincent-valentine	\N
2555518	Antwaun	Woods	10	72	318	9.625	Googling the phrase "low center of gravity" should bring up a picture of Woods. It took him three years to become a full-time starter for the Trojans, redshirting in 2011 and going in and out of the lineup as a freshman (four starts, 16 tackles, 4.5 for loss, three sacks) and sophomore (six starts, 19 tackles, two for loss, one sack). Woods earned a larger role in 2014, starting 10 times and making 37 tackles and a sack, but he missed the Holiday Bowl after tearing a pectoral muscle during practice. Things finally came together for Woods in his first-team All-Conference senior season (41 stops, seven for loss, three sacks), giving scouts enough tape to see he could be the "immovable object" to halt the "unstoppable forces" known as NFL running backs.	Feet are never at rest and constantly working to find optimal positioning. Good motor and willing worker through the whistle. Hustles hard. Played at more impactful level against the run this year over last. Surprising foot quickness and short area aptitude. Pursues hard down the line against the run. Has power in his hands and uses heavy club move as pass rusher.	Squatty with a thick midsection and short limbs. Offensive linemen with length give him issues. Plays upright and his lack of leverage could lead to issues against NFL power and double teams. Will drop head and lose track of where blocks are coming from. Needs to add an element of penetration to his game. Not a natural pocket pusher.	\N	Burly from his knees to his neck, Woods was a rock-­steady contributor for the Trojans this year after injuries and inconsistency hampered him in the past. With that said, he lacks the size and run­-stuffing element teams look for from nose tackles. Woods had a good week of practice at the NFLPA game, but will need to find a high­-end play trait he can lean on as a pro.	\N	50	5	antwaun-woods	\N
2555519	Dominique	Alexander	12	72	232	\N	Football is a family affair for the Alexanders. His father, Derrick, Sr., played at Oklahoma State and his brother, Derrick, Jr., is also heading toward an NFL career after excelling as a defensive lineman at Tulsa. Alexander's natural football acumen shone through in his first year with the Sooners, winning the Big 12 Defensive Freshman of the Year by starting the final eight games, making 80 tackles, 3.5 for loss, and forcing two fumbles. He started all 13 games each of the next two seasons, earning second-team All-Big 12 honors from the Associated Press in 2014 (107 tackles, six for loss, 1.5 sacks) and first-team all-conference accolades from coaches as a junior (103 tackles, seven for loss, 1.5 sacks). Even though he could have stayed at Oklahoma one more season, he decided to join his brother on the road to the next level.	Has speed to chase and corral. Able to close out stray running backs and bootleg­-action quarterbacks. Lateral quickness and agility to scrape from gap to gap ahead of climbing linemen on off-­tackle plays. Open field change of direction opens door to make more plays. Undersized but willing to sacrifice his body by chopping down short­-pulling guards to stack the hole. Downhill tackler looking to stop it before it gets started. Made 32 percent of his tackles this season for gains of two yards or less. Smooth drops into space with natural man-­cover talent.	Needs work in the weight room to add needed mass. Very little "take­-on" ability and can be blasted out of the hole. Sticks to blocks. Might not possess the strength or instincts to play inside in a 4­-3. Frequently over­-pursues causing him to void his run fits. Needs improved inside-­out approach in pursuit of ball carriers. Tackle consistency can improve with bulk and a "body up" attack. Can be fooled completely out of a play by play­ fakes.	Brandon Marshall	Small, but rangy linebacker with very good play speed but a lack of desired strength. It's easy to want to write Alexander off considering his issues with play strength, but then you look at his downhill tackling and ability to get to the ball and you reassess. Alexander's ability to cover in space should pair well with a move to outside linebacker in a 4-­3 where he can avoid some of the size coming at him that gave him issues inside.	"Small and can't get off blocks. Not very instinctive either. He'll get drafted earlier because he can run but I see him as a late rounder at best." -- Big 12 area scout	17	5.55999999999999961	dominique-alexander	\N
2555520	Beniquez	Brown	13	73	229	9.125	Instead of playing for a third linebackers coach in five seasons, Brown followed the lead of former teammate and 2015 second-round pick Bernardrick McKinney to enter the NFL draft after his junior season. Brown didn't garner the accolades that McKinney did during his career with the Bulldogs, failing to make a coaches or media all-conference squad over the past three years. However, there is little question of his football acumen. He started the final three games of his redshirt freshman season, recording 39 tackles, 4.5 for loss in 13 games. Brown made plays as a starting outside linebacker in 2014, ranking second on the team with 62 tackles, seven for loss, and two interceptions. In 2015, NFL scouts started really noticing Brown's play on the outside as he racked up 99 tackles and blocked two kicks, including a potential game-winner by Arkansas in the game's final seconds. He ended his career on a sharp note, making nine stops, two for loss, against North Carolina State in the Belk Bowl.	Posted productive junior season in talent­-rich SEC. Likes the game played downhill. Wrap-­up tackler who finished with 100 total tackles and four sacks this season. Big enough to play through an angle block and work back into a play. Lively in his pursuit to the sideline and racks up tackles as mop­-up man on the perimeter. Communicative on the field helping to direct traffic.	Marginal athlete lacking burst to the ball. Step slow to read and flow allowing climbing linemen to force him over the top of the block. Very average body control and balance through contact. Will occasionally side­step a block rather than taking it on with a shoulder and leveraging his gap. Instincts for run fits is sub-par. Needs better feel for seal blocks headed his way and must improve his hand usage.	Amarlo Herrera	Tape doesn't always match ­up with the production numbers ­ especially against high-­end competition like Alabama and LSU. Brown's an able tackler and