2555521	Steven	Daniels	12	71	243	\N	If any running back has a question about Daniels' size, he'll be happy to answer you with a big shot to the mouth. No matter what his official height might be, the three-year starter for the Eagles is a big-time thumper in the middle. He stepped into the linebacker rotation as a freshman (25 tackles, one start at Will) and then moved onto the first team listing as a sophomore (88 tackles, 6.5 for loss, three sacks, three pass breakups). Daniels had 72 tackles, 1.5 for loss, as a junior before taking his game to another level in 2015. The first-team All-ACC selection led B.C. with 82 stops, 16 for loss, and six sacks as the Eagles ranked first in the FBS in total defense.	Vending machine build with wide hips and burly frame made for life inside. Downhill daddy. Anticipates his run fits and will jump downhill into the gaps to congest the lane. Has terrific upper body strength and some nasty in his big hands. Able to snatch and shed blockers with force. Can sense down blocks and sinks to fend them off. Instinctive, intelligent approach to the game.	Stiff­-legged puncher when taking on climbing linemen and will give some initial ground due to a lack of bend. Below average athleticism and balance create slim margin of error as a tackler. Has some downhill burst to the ball, but has borderline range and coverage ability as a pro.	Jeff Luc	On first glance, Daniels simply appears to be too big and stiff to be able to function as an NFL linebacker, but the more you watch, the more you realize that his motor and strength makes up for some of his deficiencies. Daniels has flexibility limitations that will hurt him, but his production over the last three years as a downhill player should be considered. He plays better football than he tests and could become a consideration for 3­-4 teams looking for a thumper to add some depth.	\N	22	5.11000000000000032	steven-daniels	\N
2555522	B.J.	Goodson	13	73	242	\N	Like many players on major college football powers, Goodson rose up the ranks during his career, waiting for others to graduate or move on to the NFL before being able to show off his full skill set. He was no slouch coming from the same high school as former Clemson and NFL standout linebacker Levon Kirkland, though Goodson's game is not similar to that of his boyhood hero. After two years as a reserve (11 tackles in 2012-2013), Goodson became a co-starter at linebacker as a redshirt sophomore, making 34 tackles, 3.5 for loss, and three recovered fumbles. He took the reins of the defense in his senior season, leading the Tigers with 108 tackles, 14 of which resulted in losses including 5.5 sacks. Goodson displayed an excellent all-around game, intercepting two passes, breaking up three others, and forcing a fumble during the year to garner third-team All-ACC honors from league coaches (second-team from league media).	Team captain and leader on that side of the ball. Surprising production as a one-year starter. Stocky with a muscular build to withstand the rigors inside. Brings a thumper's mentality to the field. Uses potent punch-and-shed technique full of leverage and power to attack second level blockers. Took it to Notre Dame?s Nick Martin. Willing to sacrifice body to disrupt blocking and play flow. Plays with base and balance and able to slide under blocks to work into tackles. Has play strength to challenge turn-out blocks and leverage his gap. Rarely cheated as a tackler.	Hip stiffness leads to athletic limitations in space. Lumbering pursuit speed to the perimeter. Allows running backs a fair shot at turning the corner when he's chasing. Little margin for error with angles to the ball. Still learning patience in his flow to prevent cutback lanes. Labored backpedal in space. Grabby in coverage and could be in trouble when matched up in space. Play-action can cause him to lose his bearings.	Max Bullough	Physical, two-day linebacker with the desire to scrape downhill and strike what he sees. Goodson's lack of pursuit speed and overall athleticism could be troubling to teams, but his toughness and consistency of effort will appeal to teams who value force in the middle. Goodson could figure on the third day of the draft as a backup with eventual starter potential.	\N	1	5.41999999999999993	b.j.-goodson	\N
2555523	C.J.	Johnson	12	73	234	8.875	It's not often that a college team asks a three-year starter at defensive end to move to the middle linebacker spot. But Ole Miss coaches did just that in the spring of 2015, asking Johnson to return to his primary high school position as the master of the defense after owning the edge throughout his career. He started nine games inside as a senior (43 tackles, two for loss, two interceptions), missing a month to a torn left meniscus. Johnson had always been a bit light in the shorts to play defensive end, but he still came out blasting there as a true freshman in 2011 (three starts, 32 tackles, four for loss, one sack). He led the Rebels with 6.5 sacks (among 55 tackles, eight TFL) as a starter his sophomore year, and looked like he was on the way to another great year (12 tackles, four for loss in four games) until an ankle surgery put him on the shelf. Gaining a redshirt season, Johnson was named a captain for his junior year in 2014 (38 tackles, eight TFL, four sacks) for the nation's top scoring defense.	Accelerates past climbers and can win a race to the edge. Tremendous length to cast levers into a tackle and reel it in. Desired speed for sideline-to-sideline activity. Showed rush potential as sophomore racking up 6.5 sacks. Has hybrid characteristics. Able to slip blocks here and there with angular frame. Instinctive and aware against the pass with three interceptions over the last two seasons. Beloved by coaching staff for attitude and work ethic. Missed just two games after meniscus surgery that was expected to sideline him 4-6 weeks.	Simply not suited to play inside based on 2015 tape. Turns pads when scraping and is too easily washed away when overrunning his fit. Too much arms and not enough chest in his tackles. Misdirection and play-action leave him scratching his head too often. Has had ankle and knee surgeries over last three seasons. Play strength needs an upgrade. Has to "battle fight" to disengage from blockers and needs a clean trip to be effective flowing to ball. Has debilitating lack of hand usage inside.	\N	While Johnson is listed as an inside linebacker at the combine, he doesn't have the strength, instincts or hand-usage to make sense at that spot -- at least not without more experience and coaching. Johnson doesn't have size and speed and a background rushing the passer that could interest a team if they can get past his medicals and believe that he hasn't lost a step.	\N	93	5.04999999999999982	c.j.-johnson	\N
2555524	Cory	Littleton	13	75	238	10.125	Littleton's career at "U-Dub" was a bit up and down, moving positions and moving in and out of the starting lineup. But as they say, it's not about how you start, but where you finish. Littleton's final year on campus saw him receive honorable mention All-Pac-12 notice as a Sam linebacker, racking up 65 stops, 11 for loss, and six sacks. He had started all 13 games at defensive end as a sophomore, contributing 62 tackles, 10 for loss and five sacks for the Huskies, but found himself playing less in his junior campaign as a part-time starter (37 tackles, 3.5 for loss, one sack). Even Littleton's first year in Seattle was a bit inconsistent, as coaches inserted him into the starting line-up against Oregon after not playing him at all in the first four games of the year. He made six tackles against the Ducks (one for loss), and finished the year with 14 stops, 1.5 for loss.	Athletic with long arms and big hands. Has decent closing speed. Sinks hips and accelerates out of his change of direction. Moderate tackle production, but reduced his broken tackles and misses from a year ago. As edge rusher, has some edge bend with flexible ankles, effective shoulder dip and cat­-quick spin move. Credited with 35 pressures and six sacks on the season. Consistent special teams performer with 19 career tackles.	Play strength dips well below NFL norm for the position. Plays upright and blockers get under his pads. Allows both tight ends and fullbacks to derail his edge-­setting attempts. Can't hold the edge and is a liability when teams run downhill at him. Shows some passivity. Needs to be more physical and use his hands to clear himself from blocks.	\N	Long-limbed, stand-up pass rusher who is built more like a wide receiver than a running back. Littleton showed some pass rush ability this season and his special teams ability may be his best attribute on the next level. However, his thin frame and poor play strength could make him a long ­shot