2555525	Curt	Maggitt	13	75	247	10.125	Maggitt (muh-JIT) chipped a bone in his hip against Oklahoma in the second game of the 2015 season (he already had three tackles for loss in two games), forcing him to sit out the remainder of the season. He could have applied to the NCAA for a sixth year of eligibility, as he lost the 2013 season to a knee injury suffered as a sophomore, but decided it was time to move on to the next chapter of his life. Maggitt, whose brother, Roosevelt, played defensive end at Iowa State, was looking forward to backing up a second-team All-SEC (media) junior campaign where he led the Volunteers with 11 sacks among his 15 tackles for loss. He also had productive freshman and sophomore campaigns, starting eight times at SAM in 2011 (56 tackles, 5.5 for loss) and nine games at MIKE in 2012 (30 tackles, five for loss) before tearing his ACL.	Coach on the field and unquestioned leader of the defense. Sky­-high football character. Loves the game. Pre­-2015 hip injury, flashed twitch and suddenness of movement. Has ground-gaining strides up the field as rusher and converts advantage into edge attack for sacks. Above average skill ­set as rusher and works his plan. Able to sink, shift and redirect into shifty ball carriers. Gets jarring arm extension into target and is quick to disengage. Works to stay clean. Undeterred passion and knows how to play the game.	Plagued by injuries that limits his sample size. Thin hips and lean lower body. Limited play range and burst. Struggles to unlock hips and sprint to the sideline. Consistent contain could become an issue. Below average cover ability in man. His game could use more patience and instincts.	\N	One of the most passionate players in this draft. Maggitt plays the game with reckless abandon which can work for and against him. The team who takes him will get a player whose motor never turns off and who will give you all he's got, but his range is below average for an outside linebacker and he may be too