2555526	Cassanova	McKinzy	12	73	248	9.875	McKinzy took over the middle of Auburn's defense in 2014 after starting on the weak side as a sophomore -- and the move seemed to suit him just fine. The downhill player made life difficult for SEC running backs between the tackles (91 tackles, 11 for loss in 2014. He changed to the "Buck" linebacker spot as a senior, again excelling in a new place (74 tackles, 10 for loss, five sacks, 20 quarterback hurries). Unfortunately, McKinzy finished his final collegiate game on crutches as he watched his team win the Birmingham Bowl (very near his childhood home) over Memphis.	Has old school thickness and thump to play inside. Will get downhill and bring some funk behind his pads at the point of attack. Plays with excellent power and twitch in his hands. Edge­-setting potential with the strength and quickness to shed would-­be blockers. Has experience playing inside and outside. Produced effective pressure rate as pass rusher when working inside twist games. Credited with 17 quarterback knockdowns in 2015.	Poor instincts and feel for play design. Gets sealed by blocks he doesn't see coming and loses gap leverage due to his instincts over a lack of play strength. Bulky frame with some stiffness. Has missed 25 tackles over last three years. Marginal quickness in his lateral scrape and rarely stays ahead of the blockers in a race for positioning. No matchup cover talent. One of the starters benched for poor play and a lack of communication after the LSU game.	James Vaughters	Thumper in the middle who can rock ­and ­roll in collision drills but gets lost when he has to activate athleticism and instincts inside of a game. McKinzy is a tough guy who can wrap and finish when he's got a clean shot and he might have some special teams value as a pro. He might not be trust­worthy enough to leave him alone in the middle of a 4-­3, but could find a spot on the inside with a 3-­4 defense.	"I like his toughness but unless you are going to use him