2555527	Montese	Overton	13	74	223	9.5	Darrell Montese Overton was the son of a former ECU basketball player (Darrell, Sr.), so it was natural for him to follow in those footsteps -- though his aggressiveness is definitely more suited for the gridiron than the hardwood. His athleticism makes him a fit in any sport, and it got him onto the field as a redshirt freshman in 2012, when he started three contests and played in five more (29 tackles, 3.5 for loss). Although Overton didn?t start as a sophomore, the opposition knew when he was on the field (50 tackles, 10 for loss, six sacks, two forced fumbles). He started every game his last two seasons with the Pirates, attacking the backfield and making plays in coverage as a junior (68 tackles, 11.5 for loss, four pass break-ups) and in his second team All-American Athletic Conference senior year (70 stops, team-leading 10 TFL and 7.5 sacks, seven pass breakups.)	Has posted tremendous athletic and weight room numbers within East Carolina's strength and conditioning program. Plays with consistent aggression and tenacity. Showed ability to match up with tight ends in space. Had seven passes defensed in 2015. Has twitch for a solid punch to keep himself clean against the run. Can swoop around the edge and attack gap plays. Gives pass rush support off edge but best ­suited as blitzer. Has special teams value on kickoff coverage where he posted 11 tackles as a sophomore.	Undersized with thick waist, hips and calves. Lacks the bone structure to carry much more weight. Sticks his nose in, but can be stonewalled against quality blocking tight ends. Size and play strength will limit ability to make plays on other side of the ball as a pro. Saw six of his 7.5 sacks come over two games. Doesn't show consistent edge attack to make a living as rusher off edge.	\N	Sack numbers look fairly impressive, but skill level as a pass rusher doesn't appear to be translatable into the pro game as a situational pass rusher. Overton's best shot could be as a hybrid nickel linebacker with cover skills who also shines on special teams.	"Seems like I see a guy like this all the time now with the way college football is played. He's not loose enough to play safety and too small and skinny to play linebacker as a pro." -- NFC South scout	57	4.91999999999999993	montese-overton	\N
