2555545	Will	Redmond	14	71	182	9.125	A four-star recruit from Memphis, Redmond got caught up in a recruiting mess that gave him and his family impermissible benefits. The NCAA investigated the situation, and did not allow him to play as a freshman at MSU. Redmond only played in eight games as a sophomore and didn't start a game for the Bulldogs in 2014 because of the depth they had at the position. Still, teams made a mistake throwing his way that year as he had a team-best three interceptions (along with five breakups) as a junior. Two of those interceptions sealed victories for Mississippi State in the fourth quarter. Once Redmond finally got the starting job as a senior (25 tackles, two INT, one PBU), he could only watch the second half of the season after tearing his right ACL in practice. But NFL teams won't forget the athleticism and toughness he showed in the 19 games he played in 2014-2015.	Plus athleticism for the position. Plays with desired twitch and foot quickness. Has the physical tools to match up in tight, man coverage and mirror receiver with quality pattern recognition. Has burst to close out throws quickly and challenge the catch. Aggressive and determined in run support. Unafraid to step downhill challenge the run on his terms and near the line of scrimmage.	Average size for the perimeter. Combines height/weight will be important for him. Transition from physical downfield approach to NFL rules could be challenging early on. Takes chances that pulls him out of position. ACL tear in 2015 puts 2016 in limbo. Open field tackling can be an issue. Was on pace to miss almost 20 tackles before injury. Looks to drop hammers rather than wrap up. Has very few college starts.	Kyle Arrington	Redmond's quickness, feet and man cover ability will be intriguing to NFL evaluators, but his lack of game experience on the college level and a return from an ACL tear could weigh heavily on a team's willingness to spend an early round pick on him. His ceiling is NFL st