le. Robinson has the traits and talent to be considered one of the best press corners in this draft, but teams will have to weigh the character against the talent. Look for an electric combine which could create new buzz around the former LSU Tiger. Robinson has the raw ability to become a good NFL starter who can play on an island if asked, but I am downgrading his draft grade due to his character concerns.	"I'm not sure he's a bad kid, but I know he hates school. He's really tough -- ­typical south Florida kid. You know what you get. The interviews will work themselves out for better or worse, but you keep things simple for him and let him chase one guy around the field all day. He's really good at that." -- Former SEC defensive coach	91	5.74000000000000021	rashard-robinson	\N
