nst SEC competition with nothing more than athleticism and guile. NFL teams will look at the traits and see a player who fits the mold and who should improve with more coaching. Williams could be drafted substantially higher than my grade based on traits, but there is no guarantee he will progress quickly enough to stick long-term.	"He's going to have a great workout at the combine and get overdrafted. Frankly, I was surprised he was even invited." --­ NFC area scout	20	5.21999999999999975	brandon-williams	\N
