2555558	Lac	Edwards	19	76	209	9.375	Edwards is part of the "Australian Invasion", the movement of many colleges to find kickers and punters from Down Under due to their experience in Aussie Rules Football. Not only did Edwards excel in that sport, but also rugby, cricket, and track and field at Ballarat University in 2012. He shared punting duties in his first year in the United States in 2013, averaging 42.3 yards on 31 punts, forcing 10 fair catches and placing 13 inside the 20 yard-line. Edwards took the starting job by the reins the following year, earning first-team All-Southland Conference honors and FCS All-American notice (44.1 average, 22 fair catches, 28 inside the 20 versus just five touchbacks). His gross average dipped in 2015 (41.5) but Edwards still received second-team All-Southland notice by placing 31-of-74 kicks inside the 20 and forcing 19 fair catches.	Good size for the position. Discovered while kicking in a park in Australia. Has enough leg to post NFL-caliber hang times. Despite arrival from Australia, is not a rugby style punter. For his career has dropped 38.9 percent of his punts inside 20-yard line.	Team had no deep field goal kicker so he was used for several pooch punts. Teams unsure about consistent ability to boom punts out of his own end zone to flip the field.	\N	Edwards is one of the new breed of punters coming over from Australia and making their mark in college football. With very good size and solid hang ­time, Edwards has a chance to stand­out at the combine if he can mash and maintain his hang time.	\N	356	4.87999999999999989	lac-edwards	\N
