2555560	Marshall	Koehn	18	73	197	9.5	Koehn (pronounced CANE) was more than a kicker playing for a four-time state champion in Solon, Iowa. He was a receiver (22-298, two TD) and defensive back (seven INT) as well as using his big leg to pound the ball through the uprights (and through the end zone on most kickoffs). He also excelled at soccer and baseball (winning two state titles there, as well), while lettering twice in wrestling (an Iowa high school athletic staple). Koehn walked on to the Hawkeyes, and then waited for three years (redshirting 2011) to get this chance before breaking through in 2014, converting 12-of-16 field goal attempts (with a long of 52 yards) and all 38 extra point tries. Koehn improved his field goal conversion rate as a senior (16-20, 80 percent) and made 47-of-53 point-afters while making his only attempt from 50-plus yards out (57) in a second-team All-Big Ten season. His leg strength was especially evident on kickoffs, as he forced touchbacks on an impressive 63 percent of his kickoffs during the past two years.	Nailed a 57-­yard field goal at the gun to defeat Pitt in Week 3. Made 12-of-15 from 40 yards and beyond at Iowa. Has enough leg to kick long attempts with desired trajectory. Never had a kickoff go out of bounds in 147 tries. Athletic and willing to tackle.	Inconsistent kickoff depth allowing too many returns. Tends to work ball from right to left like a golf shot. Tied for national lead with six missed extra points in 2015. Including extra points, missed some chip shots where it appeared to become mental.	\N	While the game-­winning 57-yarder looks good on the resume, Koehn doesn't have many 50-plus attempts under his belt and he doesn?t appear to possess the leg strength for kickoffs that NFL teams like. While he strikes the ball consistently and with good trajectory, special teams coaches will be concerned about those missed extra points.	\N	32	4.75	marshall-koehn	\N
2555561	Nick	O'Toole	19	75	219	9.75	Specialists are often known for being a bit eccentric, and O'Toole lives up to that description. His big leg and handlebar mustache earned him the nickname "Boomstache" early in his WVU career, and his long beard in the Duck Dynasty mold eventually received just as much attention. But his punting skills are what NFL scouts care about, as they look for the next NFL punter coming out of Morgantown (Todd Sauerbrun, Pat McAfee). O?Toole went to Fullerton College for one year out of high school, then transferred to WVU where he quickly established himself among the top punters in the nation with a second-team All-Big 12 performance in 2013 (44.1 gross average, 22 punts inside the 20 yard-line, 23 fair catches forced). His punting average dropped in 2014 to 41.8 yards per punt, but that was more a function of his kicks not reaching the end zone (24 of 57 punts inside the 20, just two touchbacks, along with 21 fair catches) than anything else. O'Toole finished in the top ten nationally in gross average as a senior (45.4) while receiving first-team All-Big 12 accolades. His touchback total increased quite a bit (15) but he still placed 25 of 71 kicks inside the 20 and forced 18 fair catches.	Big punter with good athleticism. Ran for fake punt first down on fourth-and-12. Base punter who averaged 45.1 yards per punt with a quality hang time of 4.06 seconds in 2015. Posted quick snap­-to-­punt time in every year he punted. Only had two games all season without a punt of at least 51 yards. Has a sweet nickname (was "Boomstache" in 2014 and "Boombeard" in 2015).	Had three punts returned for touchdowns in 2014. Had surprising issues with accuracy and touch this season. Saw his touchback total jump from 3 percent last season to almost 21 percent this year.	\N	\N	\N	29	5.12000000000000011	nick-otoole	\N
2555562	Mike	Thomas	4	73	200	\N	\N	Plays like his hair is on fire. Posted eye­-opening production in 2015. Motor is always in the red and brings enthusiasm and urgency to the field. Has good size, but plays even bigger. Able to play through contact and still make difficult, contested catches. Confidence took off as season progressed. Doesn't have blazing speed but hit explosive play after explosive play. Good leaper with great body control to win high percentage of 50-50 balls. Good hand fighter down the sideline. Will drain every yard he can get out of every catch.	Average athlete inside first 10 yards. Hip tightness limits sink into and out of breaks and routes can be very raw. JUCO transfer who played just two years of FBS football. Easy target to tag for press corners. Needs to vary approach and tempo of press release. Drop rate of 10.1 percent due to focus issues. Struggles creating separation at top of his routes versus tight man coverage. Needs more commitment as run blocker.	\N	While much of Thomas' production was churned out against middling competition, it is worth noting that he had at least one touchdown catch over his last 10 games including two touchdowns and 190 receiving yards in his bowl game against Washington. Thomas could face a struggle to get open against NFL press coverage, but his desire and competitiveness will make following his run in camp an interesting one.	"You want to write him off when you start watching the tape and then he just starts outworking everyone for the big plays." -- NFL South scout	62	4.99000000000000021	mike-thomas	\N
